Product.create!([
  {id: 3269, number: "1947-96", name: "Lindley Collection ", description: "Modern traditional styling is lent a rustic touch in the design of the Lindley Collection. Walnut veneers, over solid wood, are finished in a dusty gray that complements the rich tone of the natural wood look. The dining table features an X-support trestle base and is flanked by oval backed neutral toned fabric lending to versatile placement with your home décor. Round pull hardware punctuates each drawer front of the display china and server, while graceful lines lend a distinct feminine touch to the entire collection.", category: "dining", popularity: 0, related_products: [3471], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1947-96 1947-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1947-96 1947-50.jpg"]},
  {id: 3325, number: "2601-36", name: "Tempe Collection ", description: "With a scale appropriate for any number of smaller dining spaces, the Tempe Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of the dark brown bi-cast vinyl chairs. The table and chair are constructed of metal in black finish. The collection is available in counter or traditional dining heights.", category: "dining", popularity: 0, related_products: [4210, 4043], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2601-36.jpg"]},
  {id: 4050, number: "469PU", name: "Claire Collection ", description: "This functional two-seat storage ottoman reverses to reveal 2 individual serving trays and 2 cleverly stored stools. Covered in dark brown bi-cast vinyl, this look is also offered in mottled brown polished microfiber.", category: "occasional", popularity: 0, related_products: [4225, 4212, 4211, 4112, 4099, 4098, 4097, 4095, 4096, 3967, 3706], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/469PU.jpg"]},
  {id: 3376, number: "5447-36", name: "Bayshore Collection ", description: "Transitional aesthetic meets modern lines in the casually elegant Bayshore Collection. Offering flexibility in the collection are the options of two dining tables. The 47.5-inch fixed oak veneer square table top. And the rectangular oak veneer tabletop with leaf. Both tables feature quartered book-match walnut inlay veneers with a heavily burnished finish. Supporting the uniquely veneered table top is a storage table base with a display shelf. Both tables are complimented by dark brown bi-cast vinyl chairs that feature wood cap and legs. Coordinating server is also available.", category: "dining", popularity: 0, related_products: [3442, 3434, 3423, 3422], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36.jpg"]},
  {id: 3317, number: "5100-84", name: "Luella Collection ", description: "At home in a number of decorative styles, the Luella Collection will be the perfect match for your living space. Zinc table top is supported by X-frame bases in this casual dining offering. The table is flanked by coordinating chairs, each with a neutral tone fabric and nailhead accent. Completing the look is a cool weathered oak finish that serves as the perfect contrast to the natural grey tone of the zinc table top.", category: "dining", popularity: 0, related_products: [3970], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5100-84.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5100-84_topview.jpg"]},
  {id: 3238, number: "5525-72", name: "Fielding Collection ", description: "Classic soft modern styling creates the look of the Fielding Collection. Unfettered design makes for a classically refined profile, while black inset glass is utilized for perfect contrast to the brown finish of the wood table frame. Flanking the table are the side chairs, offered in either dark or light gray fabric. The accompanying server has drawer, behind door and wine rack storage for style and functional usage. Offered in both traditional and counter height for perfect placement in your dining room.", category: "dining", popularity: 0, related_products: [3237], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5525-72.jpg"]},
  {id: 3285, number: "5466-62", name: "Festus Collection ", description: "Offered for your casual dining room is the Festus Collection. Extending to support and frame the corners of the light toned genuine marble tabletop are dark cherry finished legs. The coordinating chairs and bench feature dark brown bi-cast vinyl padded seats, each presenting a wrapped fold as the main focal accent.", category: "dining", popularity: 0, related_products: [3960], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5466-62.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5466-62 with bench.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72 5466-62_topview.jpg"]},
  {id: 3442, number: "5447-24S", name: "Bayshore Collection ", description: " ", category: "dining", popularity: 0, related_products: [3434, 3423, 3422], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-24S & 5447-29S.jpg"]},
  {id: 3305, number: "5178-60", name: "Watt Collection", description: "Blending the visual impact of marble with the hyper-stylized look of metalwork is the Watt Collection. An intricately designed chrome finished metal base rises to support the faux marble look of the table top while continuous frame chairs – offered in dark grey or camel brown fabric with contrast stitching – further lend to the contemporary feel of this casual dining collection.", category: "dining", popularity: 0, related_products: [4022], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5178-60 5178BRS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5178-60 5178GYS.jpg"]},
  {id: 3413, number: "710-36RD", name: "Daisy Collection", description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", category: "dining", popularity: 0, related_products: [3323], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-36RD.jpg"]},
  {id: 3404, number: "586-82", name: "Ameillia Collection ", description: "The solid, clean lines of the Arts and Crafts movement are interpreted from modern times in the Ameillia Collection. Substantial tapered legs and the wood veneer complement this simple and refined dining offering. Newly offered in a grey with brown undertone finish, the collection is also available in a dark oak finish. The rectangular table is flanked by the perfectly coordinating chair or bench option.", category: "dining", popularity: 0, related_products: [3280], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586-82.jpg"]},
  {id: 3338, number: "2615DC-96", name: "Marston Collection ", description: "Refined elegance is exemplified in the design of the Marston Collection. With three available table options, there is a perfect match for your home – A double pedestal base rises to support the clipped-corner rectangular tabletop of the 96-inch table, the oval topped pedestal table, and the counter height display base table, each are each flanked by chairs that feature turned front legs and nail head accent, along with a neutral tone fabric that covers the seats and backs. In support of the collection are the functional china and server. Featuring drawer and door storage, each with oval bale pull and knob hardware, you can be assured of plentiful space in which to stow or display your tabletop décor. The server also features a black melamine laminated top.", category: "dining", popularity: 0, related_products: [3975, 3974, 3526, 3300, 3299], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC_96.jpg"]},
  {id: 3739, number: "8507BE", name: "Darby Collection ", description: "Creating a look that meets your needs for relaxation and entertaining is the Darby Collection. Covered in neutral fabric, this versatile sofa offers a clean contemporary look for your modern home. Weighted wedge seatbacks, along with coordinating toss pillows -\u0080\u0093 featured in a primary color chevron pattern- can be configured to offer not only support, but provide customized seating as well. Configurations can include, but are not limited to: sofa, chaise or twin bed. Let your imagination runs wild with the Darby Collection.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8507BE_2014S-71.jpg"]},
  {id: 3495, number: "1885N-1", name: "Zaira Collection ", description: "The Zaira Collection offers modern traditional design showcasing beautiful nail head accenting headboard which elegantly contrasts its dark grey fabric.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1885N-1.jpg"]},
  {id: 3456, number: "5438-1", name: "Toulon Collection ", description: "Classic framing provides elegant contrast to the unique rustic look of the Toulon Collection. Wire-brushed distressing provides texture to the acacia veneer of this lovely bedroom suite. The functional drawers of the footboard allow for additional storage. The French provincial inspired routing lends decorative touch to each piece, while dual drawer and door storage are accented with wide set horizontal metal and wood hardware providing ample space to store your personal possessions.", category: "bedroom", popularity: 0, related_products: [3941, 3294], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5438.jpg"]},
  {id: 3402, number: "586-60", name: "Ameillia Collection ", description: "Blending the clean lines of Arts & Crafts with functional movement, the Ameillia Collection is a solid addition to your casual dining space. The drop-leaf counter height table features a Lazy-Susan making mealtime service a breeze. Substantial tapered legs and birch veneer in a dark oak finish complement this simple and refined dining option.", category: "dining", popularity: 0, related_products: [3280], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586-60.jpg"]},
  {id: 3452, number: "2042-1", name: "Woodrow Collection ", description: "Industrial design is subtly used to achieve a cool look for your bedroom in the Woodrow Collection. Dark metal hardware and corner banding with rivet look lend to the casual look of this bedroom group. Melamine laminate features a weathered-wood look that furthers the intended design. Black bi-cast vinyl accents of the headboard provides distinct complementing contrast to the finish of the collection.", category: "bedroom", popularity: 0, related_products: [3877], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2042-1.jpg"]},
  {id: 3484, number: "1708-1", name: "Odelia Collection ", description: "Making a statement to the glamorous nature of your personal design aesthetic is the Odelia Collection. The striking silver finish of the collection serves to highlight the decorative accents that reign the design – crocodile embossed drawer fronts with polished nickel hardware, mirrored top drawer fronts with their faceted knob hardware and crystal-embellished button-tufted pearl bi-cast vinyl inserts on the headboard and foot board. The available twin, full, queen, Eastern King and California King bed options allow for perfect placement in your bedroom space.", category: "bedroom", popularity: 0, related_products: [3881], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1708-1.jpg"]},
  {id: 3521, number: "1916-1", name: "Allura Collection ", description: "Glamour reigns in the design of the Allura Collection. Framing each piece is a decorative beveled mirror accent that enhances the illumination from the touch-engaged LED back-light of the headboard and mirror, as well as the under-light of the night stand. Alligator embossing and high polished crystal-enhanced hardware boldly accent the silver finish of the collection.", category: "bedroom", popularity: 0, related_products: [3475], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1916-1.jpg"]},
  {id: 3497, number: "1856-1", name: "Abbeville Collection ", description: "The ever popular Louis Philippe style is updated with functional accoutrements in the Abbeville Collection. Button and bale hardware grace the drawer fronts of each piece in the collection, while unbeknownst to the casual observer, there is hidden drawer storage on the nightstand, dresser and chest – each easily accessible with a pull of the front top frame. The sleigh bed furthers the timeless look of this adult collection, as well as youth. Okume veneers are elegantly highlighted with a traditional brown cherry finish.", category: "bedroom", popularity: 0, related_products: [3888], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1856-1.jpg"]},
  {id: 3536, number: "1867", name: "Florentina Collection ", description: "The elaborate designs of Old World Europe are treated with a distinct modern touch in the Florentina Collection. The eye-catching jewel tufting of the headboard reflects with a brilliance intended to accentuate the dusky taupe coloring of the faux silk and the rich silver – with gold undertone- finish of the wood veneer. Bombe case goods present their distinct shape as a unique focal point in your elegant bedroom. With details such as shell and acanthus leaf scrolling, carved cabriole feet and delicately designed knob hardware, the traditional look of the collection is solidified.", category: "bedroom", popularity: 0, related_products: [3319], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1867.jpg"]},
  {id: 3522, number: "1845LED-1", name: "Alonza Collection ", description: "Adding a bold touch of glamour to your boudoir is the Alonza Collection. Finished in a brilliant white, the embossed alligator board is reflected in the inlay mirrors of the bed and case pieces. The newly available back-lit LED headboard and mirror illuminate with a delicate touch, creating a dazzling glow. Turned feet provide a distinct departure from the linear design of the collection, adding a distinctly feminine flair. Drawer pulls add to the allure of the collection with an inlay crystal and chrome look.", category: "bedroom", popularity: 0, related_products: [3540], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1845LED-1.jpg"]},
  {id: 3557, number: "815TPU-1", name: "Copley Collection ", description: "The Copley Collection features clean contemporary design that will complement any home d cor. With economical and environmental concerns in mind, the night stand, dresser and mirror are conveniently packed in one carton. Chest and additional night stands are also available. The Copley Collection showcases a wide beveled wood frame with satin nickel hardware accented in espresso finish on select hardwoods and veneers. To offer more flexibility, it offers three headboard options: wood sleigh headboard, panel headboard with white bi-case vinyl inserts, and fully upholstered dark brown bi-cast vinyl headboard.", category: "bedroom", popularity: 0, related_products: [3902, 3579, 3578, 3552], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/815TPU-1.jpg"]},
  {id: 3572, number: "1737W-1", name: "Lyric Collection ", description: "Taking the expected design elements of hard contemporary and putting a decidedly feminine curve into the mix makes the Lyric Collection a unique addition to your new bedroom design. With each curve comes a new twist - satin nickel hardware accents the glossy white finish, bow-front case pieces feature ball bearing drawer glides and compliment the padded sleigh headboard & footboard, while a round, contemporary mirror reflects the modern designs that you have selected. A final, unique, addition to the collection is the glass topped night stand that furthers the contemporary feel.", category: "bedroom", popularity: 0, related_products: [3502], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1737W-1.jpg"]},
  {id: 3233, number: "5538BK", name: "Florian Collection ", description: "Ultra modern styling is exemplified with the design of the Florian Collection. The collection is offered in two color options – black metal legs with black glass top or white metal legs with clear glass top – for the perfect fit in your casual dining space. Bi-cast vinyl covered seats in coordinating black or white complete the contemporary look.", category: "dining", popularity: 0, related_products: [3232], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5538BK.jpg"]},
  {id: 3515, number: "1935PN-1", name: "Bonaventure Park Collection ", description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered pilasters frame the serpentine fronted case goods, while egg and dart molding, acanthus leaf motif and bale, and button hardware lend to the traditional look. Burl inlay creates beautiful contrast to the gold-highlighted warm cherry finish of the collection. Button tufting features prominently on the traditional low profile bed, while the footboard with heavy wood framing.", category: "bedroom", popularity: 0, related_products: [3955, 3698, 3271, 3270], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935PN-1.jpg"]},
  {id: 3865, number: "B2053SBW-1", name: "Galen Collection ", description: "Providing flexible options to fit any size bedroom is the Galen Collection. This transitional bedroom group is featured in a white finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2053SBW-1.jpg"]},
  {id: 3614, number: "8378BLK-L", name: "Barrington Collection ", description: "Soft Contemporary styling lends a cool, classic look to your modern living space in the Barrington Collection. Stitch tufting provides soft contrast to the cleanly designed lines of this seating arrangement. The attached chaise lounge and accompanying ottoman provide the opportunity for putting your feet up while you enjoy your downtime. The seating group is offered in gray, black and brown bi-cast vinyl.", category: "seating", popularity: 0, related_products: [3615, 3613], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8378BLK-L -R -4.jpg"]},
  {id: 3615, number: "8378BRW-L", name: "Barrington Collection ", description: "Soft Contemporary styling lends a cool, classic look to your modern living space in the Barrington Collection. Stitch tufting provides soft contrast to the cleanly designed lines of this seating arrangement. The attached chaise lounge and accompanying ottoman provide the opportunity for putting your feet up while you enjoy your downtime. The seating group is offered in gray, black and brown bi-cast vinyl.", category: "seating", popularity: 0, related_products: [3613, 3614], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8378BRW-L -R -4.jpg"]},
  {id: 3565, number: "1737NC-1", name: "Lyric Collection ", description: "Taking the expected design elements of hard contemporary and putting a decidedly feminine curve into the mix makes the Lyric Collection a unique addition to your new bedroom design. With each curve comes a new twist -\u0080\u0093 satin nickel hardware accents the glossy white or dark espresso finish, bow-front case pieces feature ball bearing drawer glides and compliment the padded sleigh headboard & footboard, while a round, contemporary mirror reflects the modern designs that you have selected. A final unique addition to the collection is the glass-topped night stand that furthers the contemporary feel.", category: "bedroom", popularity: 0, related_products: [3502], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1737NC-1.jpg"]},
  {id: 3642, number: "8245GY-3", name: "Kenner Collection ", description: "A classic and functional option for your living room is the Kenner Collection. Unfettered design allows for your individual decorative aspirations to soar. The sofa is available in both a pull out sleeper or traditional setup. The sofa and love seat are paired with contrast pillows. Two fabric options are available – Gray or Brown fabric – for versatile placement in a number of environments.", category: "seating", popularity: 0, related_products: [3641], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8245GY.jpg"]},
  {id: 3655, number: "8200BRW-3PW", name: "Mahala Collection ", description: "Plush seating is paired with brown top grain leather and vinyl match in the Mahala Collection to create the ultimate platform for relaxation. Offered in two reclining options, a manual or power engaged. The motion mechanisms allow for quick transition from seated to prone with either the quick pull of the manual tab or the push of the power button.", category: "seating", popularity: 0, related_products: [3654], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8200BRW.jpg"]},
  {id: 3245, number: "5510-36", name: "Seaford Collection ", description: "Subtle industrial influence creates the visual appeal of the casual dining tables of the Seaford Collection. V-matched veneer is finished in a gray tone highlights the tone variation of the wood grain. Angled trestle bases support the table tops of the collection while X-back chairs feature bi-cast vinyl padded seats for comfort.", category: "dining", popularity: 0, related_products: [3246], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510_topview.jpg"]},
  {id: 3246, number: "5510-66", name: "Seaford Collection ", description: "Subtle industrial influence creates the visual appeal of the casual dining tables of the Seaford Collection. V-matched veneer is finished in a gray tone highlights the tone variation of the wood grain. Angled trestle bases support the table tops of the collection while X-back chairs feature bi-cast vinyl padded seats for comfort.", category: "dining", popularity: 0, related_products: [3245], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510-66.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5510_topview.jpg"]},
  {id: 4154, number: "2147-12", name: "Mayville Collection ", description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes – burnished brown cherry, white, black, and the newly offered stained grey – with all of the traditional flare unique to the style – antiqued metal bale hardware and distinct framing – this collection is a perfect addition to your traditional adult or youth bedroom.", category: "home", popularity: 0, related_products: [4153, 4135, 3901, 3897, 3896, 3893, 3550, 3523, 4152, 3549], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147-12.jpg"]},
  {id: 3687, number: "8312DG-3", name: "Anke Collection ", description: "Mid-Century modern Danish styling serves as the driving design inspiration in the Anke Collection. Offered in two colors – light or dark grey – each serves as a distinct contrast to the light ash or walnut finished legs. Button tufting provides focal interest as subtly curved low-profile arms give way to the slightly splayed back.", category: "seating", popularity: 0, related_products: [3688], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8312DG.jpg"]},
  {id: 4171, number: "6409", name: "Iron Cocktail Table with Casters Amara Collection ", description: "Fun, funky and functional, the Amara Collection will provide your home with interesting conversation pieces and a look that is as unique as you are. With the turn of a crank, the adjustable table (6414) can be raised or lowered to suit your individual needs. Black iron is complimented by the bold red and white hued design of the -\u0080\u009CAtellier Loft-\u0080\u009D print that appears on the dining tabletop and carries its theme to the caster supported cocktail table (6409) -\u0080\u0093 paired with our tractor seat adjustable iron barstool (6412), you will have created the creative focal point for your dining space.", category: "home", popularity: 0, related_products: [4038], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/6412_high.jpg"]},
  {id: 3778, number: "1192RN", name: "Lucille Collection ", description: "Retro lines need not stay in the past with the mid-century inspired lines of the Lucille Collection. With fabric offerings that range from neutral to bold such as beige, gray, blue, and orange further complemented with button-tufted accenting and stylishly appointed legs, this classic accent chair will provide a look that shows your personal style.", category: "seating", popularity: 0, related_products: [4078, 4077, 4076, 4075, 3781, 3780, 3779], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1192RN.jpg"]},
  {id: 3803, number: "8228TP", name: "Ferriday Collection ", description: "Providing the flexible option for relaxation, sleep and storage, the Ferriday Collection will be a stylish and functional addition to your living room. Under seat storage is revealed with the pull of a tab on the end chaise. The lower portion of the seating configuration pulls out to reveal a pop up trundle that creates a bed space creating a relaxing environment with minimal effort. The collection is offered in blue or taupe fabric, both with contrast stitching.", category: "seating", popularity: 0, related_products: [3804], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8228TP.jpg"]},
  {id: 3835, number: "8437-1LT", name: "Iola Collection ", description: "Traditionally styled for your living space, the Iola Collection will provide you with a functional chair to fit your personal needs. Via the attached controller, you are taken from seating to reclining or standing position. The taupe 100% polyester cover, rolled arms and nail head accent further lend the classic look of the collection.", category: "seating", popularity: 0, related_products: [3823], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8437-1LT.jpg"]},
  {id: 3818, number: "1260F2S", name: "Essex Collection ", description: "With a classic profile that is covered in a dark grey or blue fabric, the Essex Collection utilizes high polish nail head accenting to provide a modern twist to the design of this elegant accent chair. Rolled tufting furthers the traditional look as do the cherry finished support legs.", category: "seating", popularity: 0, related_products: [4091, 4090, 3819], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1260F2S.jpg"]},
  {id: 3709, number: "8480GRY-3", name: "Pecos Collection ", description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors – gray, red and dark brown.", category: "seating", popularity: 0, related_products: [3708, 3707, 3679, 3678, 3677], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480GRY.jpg"]},
  {id: 3737, number: "8511TP", name: "Talon Collection ", description: "Designed with numerous room decors in mind, the transitional Talon Collection will be the perfect option for your living room. This stationary group features amply stuffed seating and a bonded leather match covering that is offered in either taupe or black.", category: "seating", popularity: 0, related_products: [3738], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8511TP_2546-31_2014S-92.jpg"]},
  {id: 3763, number: "9734BR-3", name: "Rubin Collection ", description: "With base design elements that touch retro styling, the Rubin Collection is a perfect option for your modern home. Light brown or chocolate Champion microfiber allows for versatile placement in a number of living room d cor themes. Coordinating toss pillows compliment the clean look of the collection.", category: "seating", popularity: 0, related_products: [3719, 3718, 3717], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9734BR_3402-30.jpg"]},
  {id: 3955, number: "1935-30", name: "Bonaventure Park Collection ", description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered cabriole legs support the serpentine shaped tops of the occasional tables, while egg and dart molding, along with the acanthus leaf motif lend accent to the traditional look. Creating additional interest is the distinct tray-style top of the cocktail table, with inset glass providing support to your decorative accents. Burl inlay on end, and sofa tables create beautiful contrast to the gold-highlighted cherry finish of the collection.", category: "occasional", popularity: 0, related_products: [3698, 3271, 3515, 3270], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935-30.jpg"]},
  {id: 3921, number: "4966DG", name: "Tulney Collection ", description: "The Tulney Collection is designed with the modern traditional home in mind. Designed to use as a bed or a cozy relaxation nook, it features a trundle that provides the extra space that you need for overnight guests. Covered in a neutral toned gray fabric, the black button-tufted back panel, and the nailhead accent along the curved arm panels complete the traditional look. Also available in brown and dark gray fabric.", category: "youth", popularity: 0, related_products: [3923, 3922], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4966DG.jpg"]},
  {id: 3947, number: "1704-30", name: "Moorewood Park Collection ", description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the gracefully scrolled motifs that feature prominently throughout the collection. Each occasional table features canted curved pilasters and legs that enhance the profile of the collection with lower display shelves providing additional space for you to show off your decorative choices.", category: "occasional", popularity: 0, related_products: [3651, 3487, 3273, 3272], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-30.jpg"]},
  {id: 3962, number: "3581-30", name: "Chehalis Collection ", description: "With a design that is inspired by the traditional look of Craftsman furniture, the Chehalis Collection features slate inlay on the table fronts, and a brown cherry finish that enhances the oak veneers of this well-appointed occasional offering. The cocktail table has a lift mechanism that allows for the extension of the table's top towards your seated position. Drawers feature prominently allowing ample storage space for your personal affects.", category: "occasional", popularity: 0, related_products: [4258], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3581-30.jpg"]},
  {id: 3905, number: "1356TBK-1", name: "Morelle Collection ", description: "The warmth of cottage living is invoked by the classic styling of the adult and youth Morelle Collection. The low post bed features picture framing and round finials with the case pieces featuring molded drawer fronts and knob hardware. The newly offered cherry finish offers an additional option to the classic black and white finishes that are currently available.", category: "youth", popularity: 0, related_products: [3883, 3506], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1356TBK-1.jpg"]},
  {id: 4172, number: "4727PU", name: "Synergy Collection ", description: "The need for additional storage space in your modern home will be met with the Synergy Collection. The two segments of this ottoman serve equally as storage space, yet two different functional tops define each of their roles. With the first section, an airlift mechanism lifts the seat to reveal storage below. The second section is a fully extended lift top that not only reveals storage space, but will bring the seat top towards you for those times when you need an extra table surface. This padded ottoman is covered in dark brown bi-cast vinyl with white contrast stitching.", category: "home", popularity: 0, related_products: [4040], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4727PU.jpg"]},
  {id: 3829, number: "1255F1S", name: "Alta Collection ", description: "Blending the comfort of a lounge chair with the functionality of the internal lift mechanism, the Alta Collection will be a welcome addition to your home. With an electric mechanism that, with a push of a button, takes you from fully reclined to standing, this chair aids in your mobility. The lift chair is offered in dark brown bi-cast vinyl, with contrast stitching, for versatile placement in your transitional to contemporary home.", category: "seating", popularity: 0, related_products: [4146], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1255F1S 1249F1S.jpg"]},
