  {id: 4074, number: "1195F1S", name: "Harmony Collection ", description: "A straight back gives way to the delicate slope of the arms in the Harmony Collection. This elegant accent chair is offered in a neutral beige fabric for ultimate flexibility for placement in your home. Low polish nailhead provides stylish contrast and decorative flair.", category: "home", popularity: 0, related_products: [3775], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1195F1S.jpg"]},
