  {id: 3852, number: "1217F1S", name: "Adriano Collection ", description: "Dark grey woven fabric provides a textural statement to the grandly styled Adriano Collection. Wing-backed, as a nod to traditional form, the chair features nailhead accents and button-tufting which ultimately serve to create the pinnacle in tailored styling.", category: "seating", popularity: 0, related_products: [4185, 3789], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1217F1S.jpg"]},
  {id: 3996, number: "5554-30", name: "Trammel Collection ", description: "The traditional brown mahogany finish and unique shape makes the Trammel Collection a perfect addition to your living room. Serpentine lines form the boxed table tops, each edged with short grain mahogany border. Wheat sheaf carved accents top spiral turned legs while display shelving is supported by traditional bun feet.", category: "occasional", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5554-30.jpg"]},
  {id: 3994, number: "251-01", name: "Gladstone Collection ", description: "These stately and oversized traditional occasional tables are finished in a rich dark cherry finish. Key design features include cabriole legs, black marble top with simulated wood components used to create the fretwork panels with the delicate floral bouquet motif.", category: "occasional", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/251-01.jpg"]},
  {id: 3390, number: "5445-60", name: "Wilner Collection ", description: "The contemporary design of the Wilner Collection will add flair to your modern home. From the tops of the oblong column legs reach metal supports that suspend the decorative shelf under beveled glass. Black bi-cast vinyl with white baseball stitching covers the table and chairs of this distinct dining collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5445-60.jpg"]},
  {id: 4167, number: "4602PU", name: "Reverie Collection ", description: "Adding a touch of glamour to your home is the Reverie Collection. Black bi-cast vinyl covers this stylish ottoman. The attached top opens to reveal ample storage space. Polished nailhead accent trim encircles the base of the unit, providing a sophisticated touch.", category: "home", popularity: 0, related_products: [4036], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4602PU.jpg"]},
  {id: 3799, number: "8237PU-1PW", name: "Ridder Collection ", description: "In the Ridder Collection, transitional styling allows for placement in a number of environments, making it a versatile and functional choice for your living room. Dark brown bi-cast vinyl furthers the decorative versatility of this plush power reclining chair.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8237PU-1PW.jpg"]},
  {id: 3240, number: "5518-78", name: "Mattawa Collection ", description: "Rustic industrial styling heavily influences the design of the Mattawa Collection. Metal banded rivet accenting provides visual contrast to the chairs, table and server of this casual dining collection. The brown finish has hints of gray undertone lending to the rustic look. Accompanying the collection is the server, featuring drawers and behind door storage.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5518-78.jpg"]},
