  {id: 4111, number: "471TPE", name: "Clair Collection ", description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", category: "home", popularity: 0, related_products: [4169, 4168, 4110, 4109], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471TPE.jpg"]},
  {id: 4058, number: "4723", name: "Ladd Collection ", description: " ", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4723.jpg"]},
  {id: 4047, number: "4728BK", name: "Elwell Collection ", description: "The wedge shape of the Elwell chair-side table allows for placement in the smallest of spaces while still providing ample space for a small table lamp or accessory display.", category: "occasional", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4728BK Front.jpg"]},
  {id: 3236, number: "5530-78", name: "Cline Collection ", description: "With subtle country aesthetic lending distinct influence to the design of the Cline Collection it will place perfectly in your traditional casual dining space. Gently curved arms descend from the traditional Windsor back chair creating an inviting environment in which to enjoy your meal or conversation time. The rectangular table top features rounded corners that enhance the updated style. The two tone finish lends visual contrast making this a unique choice for your dining space.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5530-78.jpg"]},
  {id: 3260, number: "5479-72", name: "Tod Collection ", description: "Capturing the natural beauty of a tree-\u0080\u0099s form lends a distinct look to the Tod Collection. The live edge table top features a light finish that serves to highlight the naturally occurring grain of the wood. The solid top is carried over in the design of the accompanying 60-inch bench, both supported with a distinct curved profile base. Wood-framed, brown fabric-covered chairs accompany this distinct table offering.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5479-72 5479S 5478-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5478-72 5479-72_topview.jpg"]},
  {id: 3249, number: "5503", name: "Yannis Collection ", description: "Sleek contemporary styling provides the platform from which you will create your casual dining space in the Yannis Collection. Ultra-bright high gloss finish of the tabletop and V-shaped support provides a distinct contrast to the high polish chrome base plate. The continuous base of the accenting chairs rises to support gray bi-cast vinyl seats with diamond pattern stitching providing additional visual interest. A smooth glide system opens with ease to reveal the self-storing butterfly leaf.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5503.jpg"]},
  {id: 3254, number: "5512-66", name: "Sage Collection ", description: "Burnished wood tabletops sit atop modern-industrial framing in the Sage Collection. Double X-back chairs feature wood upholstered cushioned seats and top-rail accenting that perfectly complements the 66-inch fixed top table. The burnished finish highlights the wood veneer and lends distinct character to this casual dining collection.", category: "dining", popularity: 0, related_products: [4007], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5512-66.jpg"]},
  {id: 3279, number: "5460-36", name: "Diego Collection ", description: "At home in your casual dining space or perhaps in your recreation room, the Diego Collection serves as a casual gathering spot to relax and enjoy a meal, or to catch up with friends and family. The birch veneer of the collection features a versatile espresso finish. The pedestal display base allows for open storage. The matching chairs feature wooden vertical slat backs and padded seats with black bi-cast vinyl covering.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5460-36.jpg"]},
  {id: 3248, number: "5504-78", name: "Stevensville Collection ", description: "Rustic styling, that is so popular in the décor of many homes, is executed in the design of the Stevensville Collection. Rough-hewn plank effect hardwood veneers feature a dark finish that effectively captures the highs and lows of the wood grain. Accompanying the casual dining group is the server with rolling barn hardware that allows the door to float from open to closed, exposing ample storage space. Ladder back chairs are framed in wood and feature neutral tone fabric seats.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5504-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5504-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5504-78_topview.jpg"]},
  {id: 3256, number: "5491-48", name: "Massey Collection ", description: "Designed for the more modest of contemporary dining spaces, the Massey Collection will provide big style for the space it occupies. An intertwined espresso-finished X-base supports a round glass top for maximum style. Four neutral toned arm chairs provide stylish support while you and guests enjoy a meal and conversation.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5491-48 5491A.jpg"]},
  {id: 3257, number: "5488-36RD", name: "Beacher Collection ", description: "Elevating to suit your needs, the Beacher Collection is a fun and functional addition to your industrial styled home. Metal legs rise to support the turn-rod adjustable height table and stools creating a platform that can be customized at any given time. Weathered wood veneer is segmented into a quadrant pattern on the tabletop for visual interest with faux riveted metal banding providing accent to the table and stools.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5488-36RD.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5488-24.jpg"]},
  {id: 3247, number: "5509-92", name: "Glendive Collection ", description: "Classic traditional styling is exemplified in the design of the Glendive Collection. Double pedestals rise to support the table top with a brown cherry finish highlighting the veneer of the wood grain. Turned legs support the urn back chairs, each seat covered with a neutral tone fabric that complements the finish of the collection. The functional display china features door and drawer storage which will provide ample space in which to stow your tabletop accessories. Knob hardware accents the drawers and doors of the collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5509-92.jpg"]},
  {id: 3255, number: "5489-36", name: "Selbyville Collection ", description: "Transitional lines paired with mixed media elements create the casual look of the Selbyville Collection. The fixed wood top of the group features a rectangular black glass insert that allows you to look down onto the under-table wine storage rack. Metal framing supports the table and wood seat swivel chairs. The cherry finish of the wood is accented by the Gunmetal finished metal.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5489-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5489-36_topview.jpg"]},
  {id: 3274, number: "5423-66", name: "Nantes Collection ", description: "Transitionally styled for placement in your casual dining room is the Nantes Collection.The acacia veneer provides a unique look and texture to this wire-brushed dining offering. Slightly curved legs create subtle motion to the wood vertical slat back chairs with neutral-toned fabric-covered padded seats.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5423-66.jpg"]},
  {id: 3266, number: "5267RF-96", name: "Reid Collection ", description: "A classic look for your traditional home, the Reid Collection offers an updated country style that will be a warm and inviting addition to your dining space. A cherry finish graces the wood veneer of the group. The rectangular table is supported by substantially appointed double turned leg bases while host and hostess chairs feature nailhead accent, neutral tone fabric and turned legs. The tabletop extends to reveal a self-storing table leaf for quick and convenient placement. The accompanying china provides ample space for display, drawer and behind door storage.", category: "dining", popularity: 0, related_products: [3943], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5267RF-96 5267RF-50 5267RF-55 5267RFA.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5267RF-96 5267RF-50 5267RF-55 5267RFS.jpg"]},
  {id: 3275, number: "5469-60", name: "Chama Collection ", description: "A complement to the modern or transitional home, the Chama Collection is a unique addition to the overall décor of your home’s dining room. Framed in metal with a faux wood veneer top, the circular patterns provide focal accent to the table base as well as the accompanying chair backs. The padded seats are covered in chocolate brown fabric for ultimate flexibility for placement in a number of casual dining rooms.", category: "dining", popularity: 0, related_products: [3949], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5469-60.jpg"]},
  {id: 3267, number: "5477N-96", name: "Orsina Collection ", description: "Casting a glamorous reflection of your personal style, the Orsina Collection will dazzle your friends and family as they enter the sophisticated dining space you have created. A sparkling silver finish enhances the mirrored table apron and fronts of the server while the pearl bi-cast vinyl of the accompanying chairs lends elegant contrast. Crystal button tufting lends additional sparkle to the collection. The server provides ample drawer and behind door storage allows for the safe keeping of your tabletop accessories.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5477N-96.jpg"]},
  {id: 3262, number: "5456", name: "Frankford Collection ", description: "Perfect for the smaller scale, traditional dining space is the Frankford Collection. The brown finish enhances the veneer of the table and accompanying chairs. A storage shelf base provides functionality to the collection while the sheaf back chairs and the neutral tone fabric seats further the traditional element of the casual dining group.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5456.jpg"]},
  {id: 3264, number: "5328-45RD", name: "Veltry Collection ", description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Veltry Collection provides an unexpectedly elegant addition to a number of dining spaces. A weathered finish covers the poplar wood veneer of the two table options; a 95.5-inch rectangular trestle table or 45-inch round pedestal table, both featuring nail head accent banding. Nailhead-accented, neutral-tone finished fabric chairs provide subtle contrast that complements the look of the collection.", category: "dining", popularity: 0, related_products: [3265], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-45RD.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-45RD_topview.jpg"]},
  {id: 3268, number: "1958-96", name: "Bevelle Collection ", description: "Modern glamour is exemplified in the design of the Bevelle Collection. Acrylic crystals frame each piece in the collection, reflecting the light to create eye-catching drama. The silver finish serves as the perfect complement to the high-polish decorative knob hardware of the china and server while medallion accents grace all pieces. Providing contrast to finish is the dark gray bi-cast vinyl of the side chairs and arm chairs. A coordinating bedroom is also available.", category: "dining", popularity: 0, related_products: [3466], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1958-96 1958-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1958-96 1958-50.jpg"]},
  {id: 3282, number: "5285-64", name: "Huron Collection ", description: "Combining the look of natural elements with transitional styling, the Huron Collection will be a welcome addition to your home's casual dining space. Placed atop legs that feature the look of weathered wood, is a faux bluestone marble top creating stunning contrast that is further enhanced by the flanking dark grey fabric-covered button-tufted chairs and bench.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5285-64.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5285-64_topview.jpg"]},
  {id: 3287, number: "5435-36", name: "Rochelle Collection ", description: "The design of the Rochelle Collection is a unique play on contemporary design. Natural walnut veneer is utilized to provide stark contrast to the wire-brushed, raised panel pedestal base of this two tone counter height table. Ultra-low back chairs, featuring dark brown bi-cast vinyl, are available with either swivel or stationary seat.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5435-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5435-36_topview.jpg"]},
  {id: 3278, number: "5429-36RD", name: "Angstrom Collection", description: "Following the trend of modern industrial inspired design is the Angstrom Collection. Metal framing provides support to the two distinctly shaped burnished wood table tops – one a rectangular table with built-in wine rack, the other an adjustable round counter-to-pub height table – as well as the accompanying stools. Turning the seats allows for quick adjustment to counter or pub height, while the option for a traditional back stool or a no-back stool allows for your personal preference to reign in designing your space.", category: "dining", popularity: 0, related_products: [3277], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36RD 5429-24ST a.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36RD 5429-24 a.jpg"]},
  {id: 3271, number: "1935-110", name: "Bonaventure Park Collection ", description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered pilasters frame the serpentine fronted china and server, while egg and dart molding, acanthus leaf motif and bale, and button hardware lend to the traditional look of all pieces. Burl inlay creates beautiful contrast to the gold-highlighted cherry finish of the collection. Two table options provide flexibility for placement in your dining space – the first, a 110-inch double pedestal base rectangular top table, the second, a 76-inch oval top single pedestal base table. Button-tufted traditional tweed fabric features prominently on the accompanying wood-framed chairs.", category: "dining", popularity: 0, related_products: [3955, 3698, 3515, 3270], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935-110 1935-55.jpg"]},
  {id: 3276, number: "5430-60", name: "Miami Collection ", description: "Ultra-modern styling is achieved in the design of the Miami Collection. The high gloss grey tabletop features chrome legs that exemplify the tenants of contemporary interior design. Continuous metal frame bases support the grey bi-cast vinyl seats of the coordinating side chairs.", category: "dining", popularity: 0, related_products: [3950], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5430-60.jpg"]},
  {id: 3280, number: "586GY-82", name: "Ameillia Collection ", description: "The solid, clean lines of the Arts and Crafts movement are interpreted from modern times in the Ameillia Collection. Substantial tapered legs and the wood veneer complement this simple and refined dining offering. Newly offered in a grey with brown undertone finish, the collection is also available in a dark oak finish. The rectangular table is flanked by the perfectly coordinating chair or bench option.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/586GY-82.jpg"]},
  {id: 3281, number: "5470-72", name: "Jemez Collection ", description: "Designed for your casual dining space is the Jemez Collection. The substantial V-profile of the table base rises to support the faux marble top in this transitionally styled dining group. Brown fabric upholstered seats feature nail head accent and provide complementing contrast to the weathered wood finish of the chair legs and table base.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72 5470-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5470-72 5466-62_topview.jpg"]},
  {id: 3308, number: "5167-96", name: "Yates Collection ", description: "Blending the look of country style with the popular modern industrial aesthetic, the Yates Collection manages to achieve a look that is unique unto itself. The turned legs of the trestle base rise to support the burnished dark oak table top. Neutral fabric covered chairs feature wood support legs – with a unique turned block look – and nailhead accent. The accompanying china’s mirrored back, display shelving, light feature, lower door storage, and drawer storage provide ample room to show off your table top accessories. The look of turned pilasters and framed panel doors further lend to the stylish collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5167-96.jpg"]},
  {id: 3301, number: "5473-103", name: "Lordsburg Collection ", description: "Elegantly designed for the traditional dining room is the Lordsburg Collection. Supported by the double pedestal base is the table’s top where the magnificent parquet veneer is highlighted by the brown cherry finish that covers the collection. Heavily carved molding provides distinct accent to the table’s top while dark brown faux leather covers the seats and backs of the coordinating wood-framed chairs. The accompanying hutch and buffet provide ample storage space for your tabletop accessories.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5473-103.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5473-103_topview.jpg"]},
  {id: 3312, number: "5147BK-78", name: "Isleton Collection ", description: "Classic country styling is achieved with the two-tone look of the Isleton Collection. The classic combination of black and cherry finish is utilized to emphasize the wood veneer of the table top and distinct shape of the turned legs of the table and chairs. The chair backs feature a double X-pattern and brown bomber jacket fabric seats. Blending each of these elements creates a classic look that will be right at home in your casual dining room.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5147BK-78.jpg"]},
  {id: 3293, number: "5411RF-82", name: "Colmar Collection ", description: "With a design that eans toward transitional styling, the wire-brushed Colmar Collection will be a welcome addition to your home casual dining space. A light burnished oak finish enhances the grain of the wood veneer allowing the character to shine through. The chairs feature light neutral fabric seats that complement the tone of wooden finish. Providing additional storage space for your tabletop décor is the accompanying server. Wine bottle display shelving, as well as drawer and door storage feature prominently. Cylindrical wood and metal hardware graces the front of the unit.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5411RF-82.jpg"]},
  {id: 3302, number: "5268-48", name: "Dryden Collection ", description: "The Dryden Collection will provide a classic look for your traditional casual dining space. The metal table base consists of turned legs that rise to support the decorative apron and faux marble table top. Metal framed chairs are backed by decorative scrollwork and feature black bi-cast vinyl seats. This unique offering will be the perfect addition to your modest dining space.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5268-48.jpg"]},
  {id: 3300, number: "2615DC-72", name: "Marston Collection ", description: "Refined elegance is exemplified in the design of the Marston Collection. With three available table options, there is a perfect match for your home – A double pedestal base rises to support the clipped-corner rectangular tabletop of the 96-inch table, the oval topped pedestal table, and the counter height display base table, each are each flanked by chairs that feature turned front legs and nail head accent, along with a neutral tone fabric that covers the seats and backs. In support of the collection are the functional china and server. Featuring drawer and door storage, each with oval bale pull and knob hardware, you can be assured of plentiful space in which to stow or display your tabletop décor. The server also features a black melamine laminated top.", category: "dining", popularity: 0, related_products: [3975, 3974, 3526, 3338, 3299], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC-72 2615DC-40.jpg"]},
  {id: 3295, number: "5400-94", name: "Schleiger Collection ", description: "Transitionally styled with a burnished brown finish, the Schleiger Collection features bold accenting and functional storage options. Sturdy legs support the metal and rivet banded table top with chair and bench options, allowing for versatile seating configurations. Metal and rivet banding with nailhead accent also features prominently on the open hutch and buffet, and mobile kitchen cart.", category: "dining", popularity: 0, related_products: [3942, 3458], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-94.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-94 5400-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-07.jpg"]},
  {id: 3309, number: "5155", name: "Rancho Portola Collection ", description: "The faux marble top of the contemporary Rancho Portola Collection will serve as the focal point of your casual dining room. The metal X-frame base creates a unique design feature while supporting the table top. The black bi-cast vinyl chairs perch on metal legs and feature contrast stitching for the ultimate in contemporary styling.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5155_6chairs.jpg"]},
  {id: 3306, number: "5177-84", name: "Beaugrand Collection ", description: "Leaning towards the styles of industrial, contemporary and transitional, the Beaugrand Collection will be an appropriate choice for a number of dining room decors. Offered in two table styles – round or rectangular – both options of the dining collection feature decorative stainless steel apron trim banding and modified X-base. The coordinating sling-back chair is upholstered in neutral grey fabric with brown tone, accenting by nailheads.", category: "dining", popularity: 0, related_products: [3969, 3307], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5177-84.jpg"]},
  {id: 3316, number: "5108-84", name: "Mill Valley Collection", description: "With traditional touches that blend elegantly with the casual look of the Mill Valley Collection, your dining room will be a warm and inviting space to share meals with your friends and family. The weathered wash finish of this dining offering has hints of grey and white alluding to a rusticated lifestyle. Neutral tone padded fabric chairs feature nailhead accent and wood leg support. The coordinating server features drawers, door and wine storage for the ultimate convenience.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5108-84.jpg"]},
  {id: 3242, number: "5516-66", name: "Janina Collection ", description: "At home in a casual country setting, the Janina Collection allows for a customizable look to match the décor of your dining space. The natural finish of the pine veneer serves to contrast the 4 available colors – teal, black, white, buttermilk – and allowing for an eclectic mix and match combination or singular color configuration.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5516BKS 5516BMS 5516TLS 5516WTS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5561BMS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5516WTS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5516BKS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516-66 5561TLS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5516BKS 5516BMS 5516TLS 5516WTS.jpg"]},
  {id: 3327, number: "5039-48", name: "Ahmet Collection ", description: "Cream colored bi-cast vinyl chairs provide an excellent contrast to the table's espresso finish in the Ahmet Collection. Scaled for a smaller dining space, the rectangular table provides comfortable seating for four.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5039_2014D-183.jpg"]},
  {id: 3326, number: "5038-48", name: "Flannery Collection ", description: "With a scale appropriate for any number of smaller dining spaces, the Flannery Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of the metal ladderbacked chairs that feature dark brown bi-cast vinyl seats. The table and chairs are constructed of metal in black finish.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5038-48_2014D-192.jpg"]},
  {id: 3315, number: "5115-92", name: "Aubriella Collection ", description: "Designed for your sophisticated dining space, the Aubriella Collection will add the elegant modern touch that you desire. The clipped corner pedestal base rises to support the rectangular table top. Wood sling back chairs feature a neutral tone fabric seat and delicately splayed support legs, furthering the modern classic look of the collection. The coordinating server feature drawers and door storages for ease of placement for your table top accessories.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5115-92.jpg"]},
  {id: 3328, number: "5070-64", name: "Cristo Collection ", description: "Dark espresso wood legs serve as an elegant contrast to the neutral toned marble tabletop in the Cristo Collection. Dark brown bi-cast vinyl covers the flanking chairs and optional bench.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5070_64_2014D-170.jpg"]},
  {id: 3334, number: "5048-72", name: "Fillmore Collection ", description: "Ultra-modern in design and ultra-inviting in feel, the Fillmore Collection will be the perfect addition to your contemporary home. Seating designed to cradle your body is covered in a cool grey fabric that contrasts perfectly against the espresso finish over oak veneer of the dining table. The fixed top table seats six comfortably, allowing you to spend quality time with your friends and family.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5048-shot-1-2-final.jpg"]},
  {id: 3331, number: "17813", name: "Alouette Collection ", description: "Like a window into your design world, the Alouette Collection provides a classic, yet modern platform for your dining experience. Offered in a rectangular or square top, this all glass table is a vision to behold. When accented with a traditional style wood chair upholstered in microfiber, the collection takes on an urban sophisticated look. When accented with a more modern bi-cast vinyl chair, the dining group suddenly becomes a study in contemporary design.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17813_2014D-148.jpg"]},
  {id: 3341, number: "2243-76", name: "Deryn Park Collection ", description: "Walking into the dining room that is occupied by the Deryn Park Collection will immediately invoke your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. Burl inset flanks the book-match veneered cherry-finished tabletop. With two table options – the rectangular double pedestal base, and the oval topped single pedestal – the collection allows you the flexibility to fit the scale of your dining room. Each chair features an elaborately designed back and a richly hued fabric cover. The china and coordinating server provide ample display and storage space for your tabletop accessories. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", category: "dining", popularity: 0, related_products: [3556, 3555, 3342], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243_76X2_H_2014D-2.jpg"]},
  {id: 3344, number: "1188", name: " ", description: " ", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1188BK_DB_RD-24.jpg"]},
  {id: 3337, number: "5056-78", name: "Creswell Collection ", description: "Country visits town in the earthy Nash Collection. This casual solid wood dining room offering is featured in a warm two-tone buttermilk and medium tone burnished oak finish. Updated ladder-back chairs flank and feature arched and beveled detail. The dining group is further complimented by a small china that features storage shelving that is fronted by wood-framed glass doors and wine bottle and hanging glass rack storage.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5056-78_mixing photo 2014D-29.jpg"]},
  {id: 3332, number: "17811", name: "Alouette Collection", description: "Like a window into your design world, the Alouette Collection provides a classic, yet modern platform for your dining experience. Offered in a rectangular or square top, this all glass table is a vision to behold.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17811-2_2014D-147.jpg"]},
  {id: 3339, number: "5055-82", name: "Norwich Collection ", description: "Traditional design elements are elegantly layered to create the beautiful Norwich Collection. Shell motif, egg & dart molding, rope molding, ball & claw feet and elegantly designed inlay begin the design journey. Book-match cherry veneer prominently highlights the top of the rectangular table and features oval inlay decorative accenting. The table is flanked by chairs that are accented by beige fabric seats. With the china's glass fronted doors providing a view of your cherished tabletop accessories, there is also drawer and wood fronted cabinets that allow for additional storage space. The collection is offered in a warm cherry finish.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5055-82_mixing color 2014D-10.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5055dr-top_2014D-10.jpg"]},
  {id: 3324, number: "5035", name: "Amara Collection ", description: "Whether used as an accessory in a bedroom, as alternative to a traditional dining chair or function as its intended, the versatility of the barstool is unmatched. As part of our Amara Collection, the metal barstool provides not only the seating space that you need, but also a fun accent for your home. Distressed for an industrial feel, each color offering – Silver, Black or White – is available in 18-inch, 24-inch and 29-inch heights.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5034_5035_BARSTOOLS_2014D-228.jpg"]},
  {id: 3333, number: "5021-54", name: "Havre Collection", description: "Sophisticated in its simplicity, the Havre Collection will be the center of attention in your dining room. Square beveled glass is placed atop an accordion shaped pedestal wood base. Finished in a rich dark espresso, the base prominently lends to the contemporary design. Each of the wood framed chairs features a flared design inset with either beige or dark brown fabric.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5021-54_2014D-143.jpg"]},
  {id: 3336, number: "2617N-36", name: "Ronan Collection ", description: "With the look of natural wood planking and a burnished rustic finish, the Ronan Collection melds with your image of a transitionally styled dining room. The substantially sized table features an extension leaf that allows for the expansion of the table to seat eight. Beige fabric covers the seat of the coordinating chairs, accenting the table perfectly.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2617N-36.jpg"]},
  {id: 3358, number: "1178", name: "Ride Collection", description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1178BLK,1178RED,1178WHT _2014D-232.jpg"]},
  {id: 3353, number: "2538-60", name: "Devlin Collection ", description: "The Devlin Collection offers the classic look of transitional styling with a nod to the Arts & Craft movement all in a well appointed six-piece group. Neutral tone fabric covers the seats of the chairs and bench in the espresso finished collection. Notch accent completes the look of the collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2538-60_2014D-188.jpg"]},
  {id: 3366, number: "2456-36", name: "Decatur Collection ", description: "The casual Decatur Collection is the transitional style that you have been searching for in your dining space. Wood legs in espresso finish support both the marble table top and chair seats. Covered in dark brown bi-cast vinyl, the tufted accenting on the chair and bench lend not only to the design but also to your comfort, when you sit with family and friends over a casual meal. Also available in counter height dining.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2456-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2456-40.jpg"]},
  {id: 3372, number: "2516-48", name: "Euro Casual Collection ", description: "With inspiration drawn from traditional French decorative accents the effortlessly elegant Euro Casual Collection adds warmth and charm to your dining room. A classic urn pedestal base acts as the sole support for the routed round table top. The rustic weathered finish on the birch veneers hints of time gone by and the complimenting fabric on the wood-framed accenting chairs lends a distinct flair to the collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2516-48 2516S.jpg"]},
  {id: 3367, number: "2466-48", name: "Dandelion Collection ", description: "Traditional does not need to mean old and stuffy. Take the gracefully turned pedestal base and sweeping arm of the accenting chairs of the Dandelion Collection, and traditional takes on a whole new meaning. The distressed dark brownish grey finish of the table is a fresh look, further complimented by the exquisitely soft grayish fabric covering each of the chairs. This collection is sure to be the highlight of your dining room.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2466-48.jpg"]},
  {id: 3357, number: "2524-36", name: "Broome Collection ", description: "With just a hint of Craftsman styling and a defined transitional look, the Broome Collection provides you and your family ample space to enjoy your time together. The dark brown finish on hardwood veneers adds to the classic look of the collection. The counter height tabletop expands to seat eight comfortably and is supported by a storage base. The warm brown bi-cast vinyl seat of the chairs blends effortlessly with the table's warm finish.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2524-36.jpg"]},
  {id: 3354, number: "2529-64", name: "Hahn Collection ", description: "White marble top stands proudly on the espresso finished base in the Hahn Collection. A warm compliment to your modern or transitional dining room, the bold design is an instant classic.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2529_S_13.jpg"]},
  {id: 3371, number: "2515-96", name: "Clayton Collection ", description: "Blending industrial and transitional style is the Clayton Collection. Clean lines and the warm burnished oak finish on pine veneers give the group a classic look, while the rod and turnbuckle accents on the table base and bench add the industrial flair that are so popular today. Planking is used to further achieve the design elements on both the table top and coordinating china curio. Glass fronted door storage as well as wine rack and drawers complete the look of the curio.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2515-96.jpg"]},
  {id: 3794, number: "8213-1", name: "Warrick Collection ", description: "The classic rolled arm chair is updated in the Warrick Collection with a stylish gray fabric cover that allows for versatile placement in your traditional home. The push back recliner eases into the prone position with motion that is initiated by your push.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8213.jpg"]},
  {id: 3351, number: "2544-64", name: "Teague Collection ", description: "A natural selection for your transitional home, the Teague Collection will compliment your lifestyle. Faux marble is set in a diamond pattern in this casual dining offering. With dark brown bi-cast vinyl seating and a espresso finish to compliment it all, this dining collection will be a welcome addition to your home.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2544-64_2014D-176.jpg"]},
  {id: 3349, number: "2547-72", name: "Maeve Collection ", description: "Lacking any appearance of pretension, the Maeve Collection provides a stylish spot for your family to enjoy their time together. A dark cherry finish on the table and wood frame chairs is complimented by the seats of dark brown bi-cast vinyl covered chairs. The cutout that tops each chair back is a simple design element that lends graceful style to this modest dining collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2547-72.jpg"]},
