  {id: 3383, number: "2423-36", name: "Junipero Collection ", description: "Utilizing the traditional elements of Mission styling, the Junipero Collection adds the feel of the early 20th Century design movement to your casual dining room. The pedestal table base supports an oval top and features storage accessible behind the drop-panel door. Framing, unique to the classic style, carries from the chairbacks to the table base. The rich brown finish serves to highlight the wood veneer.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2423-36.jpg"]},
  {id: 3375, number: "2447", name: "Clarice Collection ", description: "The ultra contemporary design of the Clarice Collection will be at home in your modern dining room. Channel stitched, white PVC chairs tuck beneath the glossy white table top. Both chairs and table are supported by sleek chrome framing that completes the look of this stylish dining group.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2447.jpg"]},
