  {id: 3501, number: "1915-1", name: "Anika Collection", description: "Drawing inspiration from Danish mid-century modern design, the Anika Collection is a stylish addition to your bedroom. The curved framing of each case piece is perfectly accentuated by polished chrome hardware and features soft-close mechanisms on the doors and storage drawers for quiet and sure closure. Offered alongside the traditional case pieces is a four-door chest. Ivory bi-cast vinyl covers the padded wood rail-topped headboard, providing stark contrast to the light ash finish over ash veneers. All pieces in the collection feature tapered legs that are signature to this classic look.", category: "bedroom", popularity: 0, related_products: [3286], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1915-1_9.jpg"]},
  {id: 3491, number: "5797N-1", name: "Ember Collection ", description: "Light neutral toned fabric and nail head accent create a classic look that makes the Ember Collection a perfect choice for a multitude of bedroom decors.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5797N-1.jpg"]},
  {id: 3485, number: "1707-1", name: "Lavonia Collection ", description: "Transitional styling is paired with classic appointments and modern technology to create the Lavonia Collection. The eye-catching dramatic curve of the headboard creates instant appeal when taking in the design of this collection. The framing of the headboard carries over to the design of the low profile footboard and turned-foot supported recessed drawer front case pieces. Modern technology comes into play with the power strip – with USB port – charging station that is mounted to the upper back of the nightstand. A gray wire-brushed finish over oak veneers furthers the classic look of this bedroom collection.\n", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1707-1.jpg"]},
  {id: 3475, number: "1916BK-1", name: "Allura Collection ", description: "Glamour reigns in the design of the Allura Collection. Framing each piece is a decorative beveled mirror accent that enhances the illumination from the touch-engaged LED back-light of the headboard and mirror, as well as the under-light of the night stand. Alligator embossing and high polished crystal-enhanced hardware boldly accent the available silver or black finish of the collection.", category: "bedroom", popularity: 0, related_products: [3521], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1916BK-1.jpg"]},
  {id: 3482, number: "1717-1", name: "Albright Collection ", description: "Refined elegance is exemplified in the design of the Albright Collection. Classic elements of understated traditional design combined with a barnwood gray finish over oak veneer, high polish knob hardware and the light neutral tone of the fabric covered headboard and footboard, blend effortlessly to create a sophisticated modern traditional look for your bedroom. Elongated, tapered turned legs support the case pieces and bed.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1717-1.jpg"]},
