  {id: 3508, number: "1907-1", name: "Terrace Collection ", description: "The traditional shape and accenting of Craftsman style is perfectly achieved in the design of the Terrace Collection. A rustic burnished oak finish that accentuates the natural characteristics of the solid poplar wood lends to the design, while antiqued bronze finished hardware adorns each case piece. Drawers and door storage provide ample storage space for your personal items.", category: "bedroom", popularity: 0, related_products: [3477], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1907-1.jpg"]},
  {id: 3509, number: "1927-1", name: "Sorrel Collection ", description: "As a unique addition to a bedroom with either modern or rustic aesthetic, the Sorrel Collection will surely turn heads. Poplar solids feature a heavily burnished finish in this cleanly designed offering. Unfettered framing is boldly accented with two-tone exposed dovetail joints, metal pull hardware on the drawer fronts, and tapered legs that provide strong support.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1927-1.jpg"]},
  {id: 3511, number: "1911-1", name: "Granbury Collection ", description: "Classic traditional styling is updated for your home in the Granbury Collection. Design features that define this timeless look; pewter finish button and bale hardware, picture framed fronts, tapered feet, and routed pilasters play against the casual grey rub-through finish, creating a look that is both modern and stately.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1911-1.jpg"]},
  {id: 3523, number: "2147SG-1", name: "Mayville Collection ", description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes – burnished brown cherry, white, black, and the newly offered stained grey – with all of the traditional flare unique to the style – antiqued metal bale hardware and distinct framing – this collection is a perfect addition to your traditional adult or youth bedroom.", category: "bedroom", popularity: 0, related_products: [4154, 4153, 4152, 4135, 3901, 3897, 3896, 3893, 3550, 3549], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147SG.jpg"]},
  {id: 3498, number: "2220-1", name: "Lorenzi Collection ", description: "The contemporary design of the Lorenzi Collection is enhanced by the addition of the durable black vinyl covering that encases each piece in the collection. Painted grey hardware provides a distinct contrast to the fabric-\u0080\u0099s finish. Scaled for urban living, this collection will prove to be a unique and stylish addition to your master, youth, and guest bedrooms.", category: "bedroom", popularity: 0, related_products: [3889], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2220.jpg"]},
