  {id: 4204, number: "5099-22", name: "Millwood Collection ", description: "With a look that blends the transitional design element of wood and accenting that lends to a modern traditional aesthetic, the Millwood Collection will help to create the ambiance that you are looking to achieve in your home or office. The decorative metal base and framing of the collection provides an industrial feel, lending to the casual contrast of the distressed ash veneer of the shelving and handscraped weathered tops.", category: "home", popularity: 0, related_products: [4226, 4205], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5099-22.jpg"]},
