  {id: 4218, number: "3228-12", name: "Factory Collection ", description: "Blending the look of vintage industrial with modern design is the Factory Collection. Burnished rustic solid wood planks make up the shelves and features wrought iron style metal framing. The continuous finished design makes this unit flexible for placement as a freestanding piece. Matching desk and occasional tables are also available.", category: "home", popularity: 0, related_products: [4217], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3228-12.jpg"]},
