  {id: 4232, number: "8019", name: "Polson Collection ", description: "Standing as a bold statement in your living room, the Polson Collection provides the perfect platform for your media storage and display. Bookshelf storage rises from each side to flank the lower television stand. The espresso finish is contrasted by the brushed satin nickel knobs that front the ample storage drawers and doors. Scoring and use of double knobs give the illusion of additional drawer storage. X-framing that is boldly featured on the side pier bookcases lends a trendy feel to this functional media unit.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8019-shot2_mixing color_2014H-1.jpg"]},
  {id: 4234, number: "14020-12", name: "Inglewood Collection ", description: "Sophistication merges with elegant lines and classic shapes in the Inglewood Collection. Display shelves flank the unit while door storage on the base allows for additional placement of your favorite entertainment items. The decorative cherry veneer is bathed in a rich and deep cherry finish that flows beautifully over the clean traditional design, giving an understated elegance for any casual entertaining setting.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/14020-12.jpg"]},
  {id: 4237, number: "4517", name: "Barolo Collection ", description: "Minimalistic lines, combined with a soft rustic aesthetic and functional appointments create the look of the Barolo Collection. Open display shelf, wine bottle rack, discreet behind door cabinet and drop-door storage provide ultimate functionality to your home's kitchen, bar or recreation area. Black metal framing flanks the natural rustic tone wood lending to the industrial look.", category: "home", popularity: 0, related_products: [3419], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4517.jpg"]},
  {id: 3983, number: "3228-30", name: "Factory Collection ", description: "Blending the look of vintage industrial with modern design is the Factory Collection. Burnished rustic wood planks are framed with wrought iron style metal supports in this stylish occasional table offering. The sofa and end tables feature X-framing that draws inspiration from the bracing seen in so many industrial settings, while the reproduction factory cart takes a functional object and turns it into a piece of art. Matching bookcase is also available.", category: "occasional", popularity: 0, related_products: [4218, 4217], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3228-12.jpg"]},
  {id: 4265, number: "8059-T", name: "Piedmont Collection ", description: "The classic transitional design and a warm brown cherry finish compliment an array of home entertainment spaces. The Piedmont Collection-\u0080\u0099s focal points are the concave curved front display shelves and routed pilasters. Media storage features glass-fronted doors for easy remote control access. Ready-To-Assemble construction.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8059-T._2014H-13.jpg"]},
  {id: 3979, number: "3447-30", name: "Orton Collection ", description: "Creatively designed to meet the needs of your casual living room is the Orton Collection. Faux marble tabletops are complimented by a rich cherry finish that covers each of the table's box-framed aprons and legs. The cocktail table features display shelf and a convenient lift tabletop that makes this functional group a welcome addition to your home.", category: "occasional", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3447-30.jpg"]},
  {id: 3237, number: "5525-36", name: "Fielding Collection ", description: "Classic soft modern styling creates the look of the Fielding Collection. Unfettered design makes for a classically refined profile, while black inset glass is utilized for perfect contrast to the brown finish of the wood table frame. Flanking the table are the side chairs, offered in either dark or light gray fabric. The accompanying server has drawer, behind door and wine rack storage for style and functional usage. Offered in both traditional and counter height for perfect placement in your dining room.", category: "dining", popularity: 0, related_products: [3238], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5525-36.jpg"]},
  {id: 3556, number: "2243-1", name: "Deryn Park Collection ", description: "Walking into the bedroom that is occupied by the Deryn Park Collection immediately displays your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. With two bed options – A graceful sleigh bed or stately poster bed– the collection allows you the flexibility to fit the scale of your bedroom and the design to accommodate your personal style. Design elements include burl inlay, traditional bale and knob hardware, claw feet and shell motifs. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", category: "bedroom", popularity: 0, related_products: [3342, 3341, 3555], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243-1.jpg"]},
  {id: 4267, number: "8046-T", name: "Pepperville Collection ", description: "Contemporary Pepperville Collection features fluted paneling, glass front and side media storage. Available in espresso finish on select hardwoods and birch veneer with satin nickel hardware. Ready-To-Assemble construction.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8046-T.jpg"]},
  {id: 3235, number: "5531-112", name: "Chilton Collection ", description: "Old world European Grandeur is exemplified in the design of the Chilton Collection. Traditional decorative elements come into play throughout the entire collection – egg & dart molding, acanthus leaf carving, floral medallions, bead molding – creating a look that will lend opulent styling to your classic dining room. Shield back dining chairs feature a neutral tone upholstered seat and are supported by intricately carved legs. A double pedestal base supports the 112-inch table top. Lending additional function to the collection is the china, with its impressive stature, featuring behind glass display storages as well as drawer and behind wood door storage. The traditional cherry finish features elegant gold tipping synonymous with the classic styling of this opulent dining collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5531-112.jpg"]},
  {id: 3234, number: "5532-36", name: "Sona Collection ", description: "Ultra-modern styling is executed flawlessly in the design of the Sona Collection. Immediately drawing your attention and providing stylistic drama to the casual dining group is the silver finished metal base and elongated cut-away bi-cast vinyl backs of the flanking dining chairs. Silver finished metal table legs support the dual glass table top -\u0080\u0093 the dining surface features a clear glass with black framing while the lower display shelf features black glass providing contrast and a finish that lends a modest touch to the over-the-top design of this casual dining offering.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5532-36.jpg"]},
  {id: 3270, number: "1935-76", name: "Bonaventure Park Collection ", description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cantered pilasters frame the serpentine fronted china and server, while egg and dart molding, acanthus leaf motif and bale, and button hardware lend to the traditional look of all pieces. Burl inlay creates beautiful contrast to the gold-highlighted cherry finish of the collection. Two table options provide flexibility for placement in your dining space – the first, a 110-inch double pedestal base rectangular top table, the second, a 76-inch oval top single pedestal base table. Button-tufted traditional tweed fabric features prominently on the accompanying wood-framed chairs.", category: "dining", popularity: 0, related_products: [3955, 3698, 3515, 3271], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1935-76.jpg"]},
  {id: 4269, number: "8060-T", name: "Carla Collection ", description: "A cherry finish, glass doors and open media storage are the focal points of the Carla Collection. Additional side accessory storage can be found behind the faux door panels on this transitionally styled entertainment unit. Ready-To-Assemble construction.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8060-T.jpg"]},
  {id: 3549, number: "2147W-1", name: "Mayville Collection ", description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes – burnished brown cherry, white, black, and the newly offered stained grey – with all of the traditional flare unique to the style – antiqued metal bale hardware and distinct framing – this collection is a perfect addition to your traditional adult or youth bedroom.", category: "bedroom", popularity: 0, related_products: [4154, 4153, 4152, 4135, 3901, 3897, 3896, 3893, 3550, 3523], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147W.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147W-12.jpg"]},
  {id: 3460, number: "2046-1", name: "Garcia Collection ", description: "Transitionally styled for your bedroom is the Garcia Collection. Created for versatile placement within a number of environments the louvered panel accents, distinct framing along with a cool gray finish over birch veneer combine to provide a clean palate for your personal decorative style. Nickel knob hardware provides subtle, yet distinct, contrast to the fronts of each case piece. The available desk is a functional addition to the collection with keyboard tray and drawer storage. The collection is offered in twin, full, queen, eastern king and california king for the perfect fit within your bedroom.", category: "bedroom", popularity: 0, related_products: [3878], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2046-1.jpg"]},
  {id: 3468, number: "1955-1", name: "Lonan Collection ", description: "With a hint of weathering so popular in industrial styling, the Lonan Collection will fit into the rustic contemporary aesthetic that you look to achieve in your bedroom. Melamine laminate mimics the look of sun-bleached wood with a darker under-hue providing subtle contrast to the design of the group, with dark finished metal handles providing additional contrast. The collection is offered in twin, full, queen, eastern king and california king for perfect placement in your home.", category: "bedroom", popularity: 0, related_products: [3880], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1955-1.jpg"]},
  {id: 3517, number: "1918-1", name: "Ashden Collection ", description: "The Ashden Collection creates visual interest with sophisticated modern traditional accents and elegant lines. The driftwood finish that enhances the beautiful cathedral grain of mindy veneer is utilized to provide contrast with the high polish of the nail heads and hardware that accents the collection. Distinctive scallop shaping graces subtle molding of the case pieces which carries over to the design of the base rail and feet of the bed. Neutral button-tufted fabric headboard is highlighted with subtle shimmer, further lending to the sophisticated yet understated elegance of the collection.", category: "bedroom", popularity: 0, related_products: [3956], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1918-1.jpg"]},
  {id: 3555, number: "2243SL-1", name: "Deryn Park Collection ", description: "Walking into the bedroom that is occupied by the Deryn Park Collection immediately displays your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. With two bed options – A graceful sleigh bed or stately poster bed– the collection allows you the flexibility to fit the scale of your bedroom and the design to accommodate your personal style. Design elements include burl inlay, traditional bale and knob hardware, claw feet and shell motifs. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", category: "bedroom", popularity: 0, related_products: [3556, 3342, 3341], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243SL-1.jpg"]},
  {id: 3629, number: "8235GY-3", name: "Breaux Collection ", description: "Contemporary design is utilized to create the look of the Breaux Collection. The collection is offered in gray or sesame cover for ultimate design versatility, with two configurations – sofa with end chaise or traditional sofa, love seat and chair – allowing for perfect placement within your living room. Reversible back cushions further the functionality and chrome legs support and lend to the modern design.", category: "seating", popularity: 0, related_products: [3628, 3627, 3626], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8235GY.jpg"]},
  {id: 3663, number: "8201BRW-3", name: "Jude Collection ", description: "Plush seating with well-appointed features makes the Jude Collection a comfortable and functional addition to your living room. The seating group is offered in either brown or black leather gel match coverings for a bold, yet, neutral statement. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", category: "seating", popularity: 0, related_products: [3664], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8201BRW.jpg"]},
  {id: 3699, number: "8329BRW-3", name: "Jarita Collection ", description: "The classic transitional styling of the Jarita Collection creates a look that is perfect for your casual living space. Offered in black or brown bi-cast vinyl, each piece in the collection offers plush seats, backs and arms. With the pull of the manual reclining mechanism, you are taken from a seated to prone position in an easy motion.", category: "seating", popularity: 0, related_products: [3700, 3660], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8329BRW.jpg"]},
  {id: 3702, number: "8334BLK-3", name: "Oriole Collection ", description: "At home in transitional to contemporary settings, the Oriole will be a welcome addition to your living room. The black AireHyde match cover is utilized for comfort and durability. Ample seating creates a plush platform for your relaxation, with each piece in the collection offering unique functionality. The dual reclining sofa features a drop-down center seatback that opens to reveal a table top and cup holders. Glider reclining mechanisms provide additional comfort on the love seat with center console unit. The Chair completes the seating collection with swivel and glider reclining function.", category: "seating", popularity: 0, related_products: [3662], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8334BLK.jpg"]},
  {id: 3798, number: "8205CH-1", name: "Earl Collection ", description: "Plush seating morphs into an enveloping relaxation platform with the pull of the manual recline mechanism in the Earl Collection. The collection is offered with a chocolate or brown covering that lends to the décor of your transitionally styled home.", category: "seating", popularity: 0, related_products: [3797], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8205CH-1.jpg"]},
  {id: 3805, number: "8211", name: "Welty Collection ", description: "Functionality plays a role in the homes of many, whether entertaining overnight guests or seeking the ultimate in lounging as you unwind from a busy day. The Welty collection will provide not only a comfortable spot for your entertaining and relaxation needs, but a functional addition to your casual living space. With a pull of the under storage pop-up ottoman, the seating group becomes a platform that can serve as a lounger or bed. The chaise seat lifts to reveal under storage that is perfect for blankets or extra pillows for your overnight guest. The fabric covering is offered in fossil, an earthy tone for a neutral addition that is perfect for your home's décor.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8211.jpg"]},
  {id: 4080, number: "8327GY-1S", name: "Deryn Collection ", description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Offered as a stand-alone accent to complement your home's décor or as part of the full Deryn Collection, the chair is featured in a modern grey or teal herringbone pattern. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", category: "home", popularity: 0, related_products: [3824, 3808, 3691, 3690, 3689, 3633, 3632, 3631, 3630], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327GY 8327GY-1S.jpg"]},
  {id: 3322, number: "1808-112", name: "Russian Hill Collection ", description: "Blending the classic aesthetic of traditional design is the Russian Hill Collection. The nod to Old World styling comes in elements such as dental, rope and bead molding, shell motifs and faux marble accent, this dining collection goes above and beyond to create the desired look. An elegant double pedestal table serves the main course of this refined collection. Acanthus scroll design encompasses the table apron and complement the wood fromed fabric chairs. The stately china stands as the focal point topped with a carved shell accent and elaborate acanthus scroll design. The server features faux marble top, glass and wood door fronts, wine storage as well as service drawers. Further lending to the design of the china and server are the fixed antique finished hardware and pilaster accenting in the style of Corinthian columns. The Russian Hill Collection is offered in a traditional warm cherry finish with gold tipping solidifying the interpretation on traditional décor.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1808-112.jpg"]},
  {id: 3858, number: "8548BLK-1", name: "Aleron Collection ", description: "With a substantial profile that exudes sophistication and power, the Aleron Collection will provide you with the perfect accent seating addition to your living or work space. Button tufting highlights the plush design of the wing-back styled arms and seatback. When the release of the reclining mechanism is combined with separate ottoman, in this swivel base chair, you will find yourself fully reclined and ready to relax. The collection is offered in black or dark brown bonded leather match.", category: "seating", popularity: 0, related_products: [3859], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8548brw_2014H-92.jpg"]},
  {id: 4085, number: "1193F5S", name: "Barlowe Collection ", description: "A tasteful accent to any room in your home is the Barlowe Collection. The dark cherry finish of the wood legs is a perfect contrast for either the oatmeal linen or the french note fabric offerings. New fabric options include: blue, grey, dark teal, chain link print, and paisley print.", category: "home", popularity: 0, related_products: [4184, 4183, 4084, 4083, 4082, 4086, 3850, 3814, 3813, 3812, 3811, 3810, 3851], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1193F5S.jpg"]},
  {id: 3611, number: "8202GRY-SC", name: "Sinclair Collection ", description: "A hint of retro styling provides a clean and classic look for your contemporary home in the Sinclair Collection. Offered in a traditional seating or sectional configuration, the options allow for the perfect placement within your living room. The collection is available in either chocolate or gray fabric with contrast pillows that furthers the look and versatility for placement within a number of home decors.", category: "seating", popularity: 0, related_products: [3612, 3610, 3609], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8202GRY-TS 8202GRY-CA_.jpg"]},
  {id: 3993, number: "5543-30", name: "Tarantula Collection ", description: "These old world Mediterranean styled tables are rich in the heritage look. Featuring in a burnish brown cherry finish and a beveled marble top, the classy look of Tarantula Collection is timeless.", category: "occasional", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5543-30.jpg"]},
  {id: 3933, number: "4829LN", name: "Caffery Collection ", description: "In creating the perfect recreational room, you need functional pieces that provide comfort to your friends and family. The Caffery Collection, with a quick adjustment to the click mechanism, turns from a casual sofa into a flat platform perfect for sleeping or just hanging out. Offered in a dark brown bi-cast vinyl with white contrast stitching or dark grey fabric, the collection also features cup holders at arms for added convenience.", category: "youth", popularity: 0, related_products: [3935, 3839], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4829LN.jpg"]},
  {id: 3241, number: "5517-78", name: "Onofre Collection ", description: "With a design that hints at futuristic contemporary styling, the Onofre is a unique offering for your casual dining space. Immediately drawing your eye is the dramatic body hugging curve of the chairs -\u0080\u0093 blending wood framing and bi-cast vinyl seats to create a profile that is out of this world. The supporting table base interlocks to create a substantial, yet open look. The look of the thick table top carries through to the design of the accompanying server. Door and drawer storage allow for the stowage of tabletop accessories, while the horizontal wine rack provides additional function. A brown finish is utilized to highlight the mindy veneer of the collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5517-78.jpg"]},
  {id: 3777, number: "1279F2S", name: "Semplice Collection ", description: "Designed for placement in a multitude of settings, the classically understated lines of Semplice Collection will complement your homes décor. Offered in either dark gray or beige fabric covering, the welt accented chair will provide a comfortable platform for any room in your home.", category: "seating", popularity: 0, related_products: [3776], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1279F2S.jpg"]},
  {id: 4052, number: "4508-PH", name: "Yara Collection ", description: "Providing extra seating in your casual dining space, the Yara is a modern take on the classic barstool. Intersecting circles stack one upon the other to create eye-catching style and serve as the base to support the gray fabric seat. The accent barstools are offered in 19.5-inch and 28-inch heights to meet the requirements for your space.", category: "home", popularity: 0, related_products: [4224], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4508-PH 4508-SH.jpg"]},
  {id: 3251, number: "5496-78", name: "Makah Collection ", description: "The look of Arts and Crafts styling is updated for the modern home in the Makah Collection. Classically framed chairs pair with the tapered leg table to create this casual dining look. A dark brown finish highlights the wood veneer allowing for the neutral tone of the seats to blend with little effort. The drawers of the server, table apron and chairs feature framing that lends accent to the classic look. The accompanying server features a double wine rack as well as drawer and behind door storage.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5496-78.jpg"]},
  {id: 4053, number: "1277", name: "Adlai Collection ", description: "Complementing your home's décor is the Adlai Collection. The modern wingback accent chair is offered in a blue or gray quatrefoil pattern, adding distinct flair to any room in your home. Wood legs support, lending further accent to the modern traditional profile of the chair.", category: "home", popularity: 0, related_products: [3602], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1277F1S 1277F2S.jpg"]},
  {id: 3261, number: "5478-72", name: "Hobson Collection ", description: "Created with the look of natural simplicity, the Hobson Collection blends elements of contemporary design to achieve a unique offering for your dining space. The live edge table top features a light finish that serves to highlight the naturally occurring grain of the wood. Supporting the tabletop and accompanying bench are gray finished legs. The solid top is carried over in the design of the accompanying 47.5-inch bench. Wood framed chairs feature a modern profile chair back, wrapped in brown bi-cast vinyl.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5478-72 5478S 5478-13.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5478-72 5479-72_topview.jpg"]},
  {id: 3265, number: "5328-96", name: "Veltry Collection ", description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Veltry Collection provides an unexpectedly elegant addition to a number of dining spaces. A weathered finish covers the poplar wood veneer of the two table options; a 95.5-inch rectangular trestle table or 45-inch round pedestal table, both featuring nail head accent banding. Nailhead-accented, neutral-tone finished fabric chairs provide subtle contrast that complements the look of the collection.", category: "dining", popularity: 0, related_products: [3264], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-96.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5328-96_topview.jpg"]},
  {id: 3345, number: "2601-48", name: "Tempe Collection ", description: "With a scale appropriate for any number of smaller dining spaces, the Tempe Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of the dark brown bi-cast vinyl chairs. The table and chair are constructed of metal in black finish.", category: "dining", popularity: 0, related_products: [4210, 4043, 3325], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2601-48_2014D-193.jpg"]},
  {id: 3995, number: "710-30", name: "Daisy Collection ", description: "Daisy Collection combines superb visual appearance and fine quality that you need in your living room area. The table group features an elegant tulip base and clear glass top to provide an open airy feel. Constructed of hardwood veneers in refreshing espresso finish.", category: "occasional", popularity: 0, related_products: [3323], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-30.jpg"]},
  {id: 4051, number: "4510", name: "Kennelly Collection ", description: "Opening to reveal additional seating, the Kennelly Collection is a fun and functional accent for your home. The larger nesting accent ottoman provides additional storage when the smaller ottoman is removed. Offered in brown, blue, mustard and red, the larger ottoman is encircled by high-polish nail head accenting for added stylistic drama.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4510.jpg"]},
  {id: 3272, number: "1704-60", name: "Moorewood Park Collection ", description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that feature prominently throughout the collection. Two elegant table options allow for perfect placement within your dining room – the first, a 108-inch rectangular top leg table and the second, a round 60-inch fixed-top table. Flanking the two table options are the subtly ornate dining chairs with their prominent medallion backs and decorative neutral tone seats. The china features canted curved pilasters and legs that enhance the profile of the collection while button and bale, along with knob, hardware featured in an antiqued bronze finish lend subtle contrast. Behind glass display storage along with the doors and drawers of the supporting buffet provides ample storage space for your tabletop accessories.", category: "dining", popularity: 0, related_products: [3947, 3651, 3487, 3273], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-60.jpg"]},
  {id: 3289, number: "5415RF-78", name: "Sedley Collection ", description: "Whether your home leans to transitional or contemporary design, the Sedley Collection will be the perfect fit for your casual dining needs. From the distinct walnut veneer pattern to the unique cut-away design of the trestle table base, bench, and server, each design component lends to placement in a variety of dining spaces. The chocolate brown tone of the chair fabric compliments the finish of the group. Convenience factors in the self-storing table leaf, while the server provides additional function with sliding doors that open to reveal wine bottle rack and shelf storage. Drawer storage with recessed pull hardware features prominently at the center of the server.", category: "dining", popularity: 0, related_products: [4203, 4073, 3592, 3457], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5415RF-78.jpg"]},
  {id: 3294, number: "5438-96", name: "Toulon Collection ", description: "Bold curves provide elegant contrast to the unique look of the Toulon Collection. The heavily scrolled base supports of the table feature routing with dark pewter-finished metal trestle that connects. Wire-brushed distressing provides texture to the acacia veneer of the table and pine of the accompanying chairs. The optional bench takes shape with inspiration drawn from church pews, allowing for a look that will add a special touch to your dining room. The French provincial inspired routing lends decorative touch to the accompanying server, while dual drawer and door storage provides ample space to stow your tabletop accessories.", category: "dining", popularity: 0, related_products: [3941, 3456], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5438-96.jpg"]},
  {id: 3298, number: "5425-90", name: "Benwick Collection ", description: "From every angle, the modern traditional design of the Benwick Collection shines through. Offered with two table options – a classic turned-leg table and a display base counter height table. Each table is flanked by elegantly designed fabric covered chairs that are supported by turned dark cherry legs. Nail head accenting furthers the chair’s modern traditional styling. The accompanying server features ample behind door storage, wine bottle rack, and brushed nickel knob hardware. Birch veneer is used throughout the collection and is enhanced by a dark cherry finish", category: "dining", popularity: 0, related_products: [3297], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5425-90.jpg"]},
  {id: 3304, number: "5179-90", name: "Urbana Collection ", description: "Transitional design combined with the trend forward look of industrial styling creates the look for the Urbana Collection. Turnbuckle accents paired with faux rivets lend to the design of the table and accompanying server. A burnished finish is utilized to highlight the wood grain veneer. The wood-framed metal X-backed chairs feature dark brown bi-cast vinyl seats and backs. In addition to the traditional chairs, an optional bench is also available as a unique seating option. The server features drawer and door fronted storage along with wine rick and stationary leg supports that mimic industrial cart wheels.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5179-90.jpg"]},
  {id: 3307, number: "5177-54", name: "Beaugrand Collection ", description: "Leaning towards the styles of industrial, contemporary and transitional, the Beaugrand Collection will be an appropriate choice for a number of dining room decors. Offered in two table styles – round or rectangular – both options of the dining collection feature decorative stainless steel apron trim banding and modified X-base. The coordinating sling-back chair is upholstered in neutral grey fabric with brown tone, accenting by nailheads.", category: "dining", popularity: 0, related_products: [3969, 3306], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5177-54.jpg"]},
  {id: 3310, number: "5149-48", name: "Loyalton Collection ", description: "Traditional elements of wood and metal blend to create the casual look of the Loyalton Collection. Forged of metal, the double-X patterns flow from chair back to table apron, while the traditional look of the table’s turned legs is given a modern update. Wood is utilized for the tables routed top, chair seats and chair backs. The collection is offered in two distinct styles to fit your needs – 48 inches fixed rectangular top and 40 inches square counter height top.", category: "dining", popularity: 0, related_products: [3311], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-48.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-48_topview.jpg"]},
  {id: 3290, number: "5409-78", name: "Kavanaugh Collection ", description: "Subtle contemporary design is called into play for the styling of the Kavanaugh Collection. Lending a distinct look to the tabletop is a classic checkerboard veneer pattern which is highlighted by a dark brown, with gray undertone finish. Providing contrast to the table is the brownish gray fabric coverings of the shallow cove back seats.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5409-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5409RF-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5409-78_topview.jpg"]},
  {id: 3320, number: "1828-92", name: "Chambord Collection ", description: "Modern elegance takes form in the Chambord Collection. Immediately catching your eye is the striking champagne gold finish, an opulent mix of silver and gold hues, elegantly accented by the faux silk fabric and gold brushed hardware that is featured on select pieces of the collection. The serpentine-fronted table, china and server are adorned with canted pilasters featuring overlay fretwork, scalloped bases and a delicately splayed cabriole leg. Further lending to the lavish look of the collection is the faux silk back and seat of the coordinating chair. The server features drawer and door storage as well as an elegant quatrefoil hanging mirror. Completing the look of the collection is the graceful china. With mirrored backing, light feature, glass display shelving and drawer storage, your dining room will be the talk of the dinner party.", category: "dining", popularity: 0, related_products: [4259, 4138], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1828-92.jpg"]},
  {id: 3373, number: "2477-78", name: "Alita Collection ", description: "A reflection of your taste for clean design with both traditional and modern flair, the Alita Collection perfectly encompasses your style preference. Warm burnishing on warm cherry finished patterned veneers add depth to the casual dining offering. Coordinating server features door storage and wine bottle rack. Seat cushions are covered in dark brown bi-cast vinyl.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2477-78.jpg"]},
  {id: 3346, number: "2588-92", name: "Chicago Collection ", description: "Design elements from traditional to mid-century modern are delicately balanced in the sophisticated Chicago Collection. This deep espresso finished dining group takes the uniquely routed accent of the apron and double pedestal table base and applies it to the accompanying server. The shape of the chairs conforms to your body, providing comfort and maximum style. From the grand sweep of the arms to the traditional nail-head accent, this chair is the ultimate in sophistication. The server features tassel drop pull hardware in a nickel finish and features door storage.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2588-92_2014D-16.jpg"]},
  {id: 3329, number: "5034", name: "Metal Chairs, with 2555-84 Dining Table, Amara Collection", description: "Boldly hued chairs from our Amara Collection provide a welcome pop of color in your whimsical room decor. Shown here with the table from our Derry (2555) Collection, the chairs can be mixed or matched to suit your personal style. Constructed of metal, the industrial chic chairs are finished in blue, red, yellow or rust. Not limited to the dining room, the Amara Collection can be used to accent any room of the house.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5034_MULTI_2014D-165.jpg"]},
  {id: 3356, number: "2526-96", name: "Marie Louise Collection ", description: "With inspiration drawn from the traditional French decorative accents the effortlessly elegant Marie Louise Collection adds warmth and charm to your dining room. A classic urn double pedestal trestle base acts as the focal point of the collection. The rustic weathered oak finish on the pine veneers hints of time gone by and the button-tufted bomber jacket fabric on the wood-framed accenting chairs compliments the casually elegant table perfectly.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2526-96 Shot 1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2526-96 Shot 2.jpg"]},
  {id: 3360, number: "1156", name: "Ride Collection ", description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1156 Low.jpg"]},
  {id: 3365, number: "1145", name: "Ride Collection ", description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1145 Low.jpg"]},
  {id: 3394, number: "626-36", name: "Westwood Collection ", description: "Deriving its look from a multitude of classic designs, the Westwood Collection is the perfect blend of traditional accents and transitional styling. Drawing from the classic details of matched oak veneer patterns and fabric-covered swivel seats – the transitional design is pulled together with functional table base storage, and a warm burnished oak finish. Also available in Napoleon style counter height chair", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/626-36.jpg"]},
  {id: 3399, number: "1393W-78", name: "Ohana Collection ", description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. It’s a warm look you’ll love having in your home", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393W-78.jpg"]},
  {id: 3411, number: "1372-36", name: "Crown Point Collection ", description: "Adorn your dining area with Crown Point Collection. This grand scale casual dining in warm merlot finish is as strong and durable as they are stunning. Table top is constructed of mango veneer with strong support tapered legs. Attractive X-back dining chair with comfortable leather-look dark brown seat completes the unsophisticated streamlined look.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1372-36.jpg"]},
  {id: 3435, number: "2514BK-36", name: "Norman Collection ", description: "Perfectly scaled for a cozy dining area is the Norman Collection. The counter height table features double display shelves, providing ample storage and display space. Each chair, in this five-piece dining offering, has a double X-back design that lends a transitional feel. The black finish compliments the casual feel of this offering.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2514BK-36.jpg"]},
  {id: 3421, number: "5511", name: "Delmar Collection ", description: "The burnished finish and classic profile of the Delmar Collection will be a perfect fit for your modest casual dining space. Splat back wood chairs with brown bi-cast vinyl seats flank the counter and dining height table offerings. Routed detailing provides a linear focal point on the tables tops.", category: "dining", popularity: 0, related_products: [3420], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5511.jpg"]},
  {id: 3437, number: "2458", name: "Andover Collection ", description: "Your cozy breakfast nook will be complete with the Andover Collection. The transitional pedestal base lends a casual feel to this five-piece offering. The table and spindle-back chairs are featured in an antique oak and black two-tone finish.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2458.jpg"]},
  {id: 3377, number: "3217PU", name: "Hight Rowley Collection ", description: "Interactive, stylish and just plain fun, the Rowley Collection provides a multifunctional table for your living space. The hydraulic gas lift of the metal table base easily ascends with the push of a button to take the dark cherry finish table from cocktail height to dining level. Accompanied by four dark brown bi-cast vinyl covered storage ottomans that act as dining chairs, this versatile group is the perfect option for those looking for additional space as well as style.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3217PU Low.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3217PU High.jpg"]},
  {id: 3414, number: "710-72", name: "Daisy Collection", description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", category: "dining", popularity: 0, related_products: [3323], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-72.jpg"]},
  {id: 3428, number: "5106BK", name: "Edgar Collection ", description: "Richly hued faux marble tops the metal counter height table base in the three-piece Edgar Collection. Vertical slat detailing provides stylish detail to this convenient table offering. Two black bi-cast vinyl covered barstools complement the collection while easily storing beneath the table allowing for placement in the coziest of dining spaces.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5106BK_2014D-223.jpg"]},
  {id: 3441, number: "2459", name: "Brooksville Collection ", description: "The book-match veneer of the table and the double-X chair back design of the Brooksville Collection stand out as the focal points of this transitional six-piece dining group. The fixed-top table, chairs and bench are offered in a warm cherry finish. The chairs and bench feature black bi-cast vinyl upholstered seating. Seating six comfortably, the collection is a great addition to your casual dining area.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2459 Shot 1.jpg"]},
  {id: 3451, number: "1990-1", name: "Leavitt Collection ", description: "Unfettered transitional styling creates a unique offering for your bedroom in the Leavitt Collection. The framing of the case goods and bed lend an air of understated sophistication that is enhanced by the antiqued bronze pull hardware and brown cherry finish that graces the mindy veneer of the collection.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1990-1.jpg"]},
  {id: 3461, number: "1978W-1", name: "Elsmere Collection ", description: "Traditional elegance is captured in the design of the Elsmere Collection. From the feminine shape of the bomber case goods to the flair of feathered scroll that graces each piece of the bedroom suite, the romantic classicism of French provincial is perfectly executed. An antique gray finish is utilized to highlight the pine solids and tropical veneers with subtle silver tipping accents. Antiqued hardware with an elegant design that so perfectly complements the look of the group provides additional decorative accenting.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1978W-1.jpg"]},
  {id: 3458, number: "5400-1", name: "Schleiger Collection ", description: "Transitionally styled with a burnished brown finish, the Schleiger Collection features bold accenting that lends to a rustic industrial interpretation. Substantial framing provides a masculine profile while decorative metal and rivet banding on each piece of the group furthers the look. Each case piece features metal horizontal hardware.", category: "bedroom", popularity: 0, related_products: [3942, 3295], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5400-1.jpg"]},
  {id: 3471, number: "1947-1", name: "Lindley Collection ", description: "Modern traditional styling is lent a rustic touch in the design of the Lindley Collection. Walnut veneers over solid wood are finished in dusty gray to complement the rich tone of the natural wood look. Round pull hardware punctuates each drawer front, while graceful lines lend a distinctly feminine touch. Button-tufting features prominently on the padded wood-framed headboard and footboard.", category: "bedroom", popularity: 0, related_products: [3269], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1947-1.jpg"]},
  {id: 3481, number: "1718GY-1", name: "Begonia Collection ", description: "Casual transitional styling lends versatility to the placement of the Begonia Collection in a number of bedroom settings. The gray finish lends distinctly to the execution of different looks from traditional to country casual, with knob hardware punctuating the look of each framed drawer front. Hidden drawers in the nightstand and dresser provide discrete storage for your valuables, while the storage drawers of the footboard provide a more visible means of additional storage capability. Bun feet support the case goods and a sleigh headboard finish off the transitional design of the collection.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1718GY-1.jpg"]},
  {id: 3487, number: "1704-1", name: "Moorewood Park Collection ", description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that feature prominently throughout the collection. The headboard of the bed in combination with the low-profile footboard, create eye-catching drama with their bold design. Each case piece feature canted curved pilasters and legs that enhance the profile of the collection while button and bale, along with knob, hardware featured in an antiqued bronze finish lend subtle contrast.", category: "bedroom", popularity: 0, related_products: [3947, 3651, 3273, 3272], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-1.jpg"]},
  {id: 3478, number: "1866GY-1", name: "Marceline Collection ", description: "Your bedroom reflects your personal style – Allured by trend forward design, the Marceline Collection satisfied your desired look. The striking gray rub-through or the newly offered gray water-based finishes of the collection feature hand distressing for a subtle weathered look. Geometric molding provides a distinct contrast to the traditionally framed case goods. Substantially sized turned legs enhance the look of the oversized case pieces and mansion headboard.", category: "bedroom", popularity: 0, related_products: [3537], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1866GY.jpg"]},
  {id: 3502, number: "1737NGY-1", name: "Lyric Collection ", description: "Taking the expected design elements of hard contemporary and putting a decidedly feminine curve into the mix make the Lyric Collection a unique addition to your new bedroom design. With each curve comes a new twist – satin nickel hardware accents the glossy white or dark espresso or brownish grey finish, bowfront case pieces feature ball bearing drawer glides, and compliment the padded sleigh headboard and footboard, while a round, contemporary mirror reflects the modern designs that you have selected. A final unique addition to the collection is the glass-topped night stand that furthers the contemporary feel.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1737NGY.jpg"]},
  {id: 3514, number: "1919-1", name: "Antoinetta Collection ", description: "Traditional elements of Old World European styling are blended to create the look of the Antoinetta Collection. Acanthus leaf motif as well as bead and heavily carved moldings serve as the initial draw to the traditional design. Canted pilasters, marble tops, sunburst medallion, and classic button and bale hardware further accent the case goods. Cherry veneers and burl inlay are highlighted by a warm cherry finish with gold tipping.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1919.jpg"]},
  {id: 3503, number: "1908-1", name: "Summerlin Collection ", description: "Classic elements of contemporary design are executed to create the look of the Summerlin Collection. Modified convex lines provide bold detailing to the case good drawer fronts, while brushed nickel hardware compliments. The dual panel black bi-cast vinyl padded headboard inserts feature detail stitching and provide contrast to the espresso finish of the collection.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1908.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1908-11.jpg"]},
  {id: 3524, number: "2024-1HB", name: "Potrero Collection ", description: "Versatile placement options, while utilizing minimum space makes the Potrero Collection the right choice for your home. Three styles, each offered in a single cover are available – Grey fabric with vertical channel seaming, black bi-cast vinyl with x-stitch pattern and brown fabric with square pattern.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2024-1HB.jpg"]},
  {id: 3537, number: "1866", name: "Marceline Collection ", description: "Your bedroom reflects your personal style -\u0080\u0093 bold with an eye for trend forward design, the Marceline Collection achieves your desired look. The striking grey finish of the collection features hand rub-through distressing for a subtle weathered look. Geometric molding provides a distinct contrast to the traditionally framed case goods. Substantially sized turned legs enhance the look of the oversized case pieces and mansion headboard.", category: "bedroom", popularity: 0, related_products: [3478], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1866.jpg"]},
  {id: 3564, number: "2145-1", name: "Edina Collection ", description: "Enhancing the contemporary design of your bedroom is the focus of the Edina Collection. The espresso-hinted cherry finish builds on the unexaggerated lines of this bedroom suite, blended with the tufted bi-cast vinyl inserts on the headboard and the polished nickel finishedÂ hardware, culminates to achieve the modern look. Whether it is a hard contemporary or a softer transitional feel, your décor design options are wide open with this classic bedroom collection.", category: "bedroom", popularity: 0, related_products: [3890], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2145-1.jpg"]},
  {id: 3576, number: "1733-1", name: "Verano Collection ", description: "Appropriate for a number of bedroom designs, the Verano Collection is the perfect permanent canvas for your ever-evolving personal style. The rich espresso finish is delicately accented with discrete brushed nickel knob hardware and stylish framing that carries from the bed to the mirror in this modern transitional set. The pull-out tray on the nightstand provides additional space for your bedside needs.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1733-1.jpg"]},
  {id: 3579, number: "815PU-1", name: "Copley Collection ", description: "The Copley Collection features clean contemporary design that will complement any home d  cor. With economical and environmental concerns in mind, the night stand, dresser and mirror are conveniently packed in one carton. Chest and additional night stands are also available. The Copley Collection showcases a wide beveled wood frame with satin nickel hardware accented in espresso finish on select hardwoods and veneers. To offer more flexibility, it offers three headboard options: wood sleigh headboard, panel headboard with white bi-case vinyl inserts, and fully upholstered dark brown bi-cast vinyl headboard.", category: "bedroom", popularity: 0, related_products: [3902, 3578, 3552, 3557], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/815PU-1.jpg"]},
  {id: 3624, number: "8203GY-3", name: "Iniko Collection ", description: "Contemporary styling is exemplified in the design of the Iniko Collection. Offered in gray or red leather gel match coverings, the cleanly designed seating group will fit perfectly in your modern home. Chrome legs support and provide decorative accent that is in line with the sleek look of the collection.", category: "seating", popularity: 0, related_products: [3625], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8203GY.jpg"]},
  {id: 3527, number: "2168WW-1", name: "Orleans II Collection ", description: "An updated look to the grandeur of Old World Europe is flawlessly executed in the Orleans II Collection. Acanthus leaf carvings feature prominently and blend with elegantly appointed moldings on each piece of this stately bedroom. Wreath accents lend dramatic flair to the bed and mirror as does the sculpted lion-\u0080\u0099s foot base, supporting each of the case pieces. Heavy pilasters rise with and are topped with carved finials on the neutral-toned, linen accented headboard and footboard. The washed white and weathered brown two-tone finish lends to the unique styling of this elegant bedroom collection.", category: "bedroom", popularity: 0, related_products: [3321], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168KWW-1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168WW-11.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168WW-9.jpg"]},
  {id: 3550, number: "2147BK-1", name: "Mayville Collection ", description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes – burnished brown cherry, white, black, and the newly offered stained grey – with all of the traditional flare unique to the style – antiqued metal bale hardware and distinct framing – this collection is a perfect addition to your traditional adult or youth bedroom.", category: "bedroom", popularity: 0, related_products: [4154, 4153, 4152, 4135, 3901, 3897, 3896, 3893, 3523, 3549], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147BK.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147BK-12.jpg"]},
  {id: 3621, number: "8216SD-3", name: "Cornelia Collection ", description: "Casual traditional styling creates the look of the Cornelia Collection. The seating group is offered in two coverings, sand or dark gray fabric to easily blend and complement to your home’s décor. Nail head trim along with rolled arms lend to the soft traditional style.", category: "seating", popularity: 0, related_products: [3622], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8216SD.jpg"]},
  {id: 3628, number: "8235GY", name: "Breaux Collection ", description: "Contemporary design is utilized to create the look of the Breaux Collection. The collection is offered in gray or sesame cover for ultimate design versatility, with two configurations – sofa with end chaise or traditional sofa, love seat and chair – allowing for perfect placement within your living room. Reversible back cushions further the functionality and chrome legs support and lend to the modern design.", category: "seating", popularity: 0, related_products: [3629, 3627, 3626], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8235GY-L 8235GY-R.jpg"]},
  {id: 3636, number: "8244BU-3", name: "Erath Collection ", description: "Mid-Century modern design creates the look of the Erath Collection. High seatbacks and low slung arms lend shape to the profile of the collection while the dramatic tones of blue, orange and sand create visual and decorative interest. Splayed wood legs that are synonymous with mid-century styling support this modern seating group.", category: "seating", popularity: 0, related_products: [3635, 3634], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8244BU.jpg"]},
  {id: 3661, number: "8210GRY-3", name: "Taye Collection ", description: "With styling that lends to either transitional or contemporary living spaces, the Taye Collection will provide a comfortable platform for your much deserved downtime. Gray leather gel match covers this plush seating group. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8210GRY.jpg"]},
  {id: 3664, number: "8201BLK-3", name: "Jude Collection ", description: "Plush seating with well-appointed features makes the Jude Collection a comfortable and functional addition to your living room. The seating group is offered in either brown or black leather gel match coverings for a bold, yet, neutral statement. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion.", category: "seating", popularity: 0, related_products: [3663], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8201BLK.jpg"]},
  {id: 3673, number: "8230BRW-2L", name: "Bastrop Collection ", description: "Comfort is the name of the game in the Bastrop Collection. The collection is offered in several configurations – traditional sofa, love seat and chair, and sectional – for versatile placement in your living room maximum relaxation potential in your downtime. The two optional coverings – black or brown leather gel match – feature contrast welting for definition of profile and modern accenting. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion. The sectional configuration features a left side love seat with reclining end and the right side double reclining love seat with center console unit featuring cup holders and storage.", category: "seating", popularity: 0, related_products: [3676, 3675, 3674], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8230BRW_2L%2BCR%2B2RCN.jpg"]},
