  {id: 3675, number: "8230BLK-2L", name: "Bastrop Collection ", description: "Comfort is the name of the game in the Bastrop Collection. The collection is offered in several configurations – traditional sofa, love seat and chair, and sectional – for versatile placement in your living room maximum relaxation potential in your downtime. The two optional coverings – black or brown leather gel match – feature contrast welting for definition of profile and modern accenting. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion. The sectional configuration features a left side love seat with reclining end and the right side double reclining love seat with center console unit featuring cup holders and storage.", category: "seating", popularity: 0, related_products: [3676, 3673, 3674], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8230BLK_2L%2BCR%2B2RCN.jpg"]},
  {id: 3740, number: "9669FCP", name: "Hankins Collection ", description: "With plenty of room for your family and friends to get comfortable, the multifunctional Hankins Collection will be a welcome addition to your living room. The chocolate textured plush microfiber and dark brown bi-cast vinyl are the perfect complement to your transitional decorative style. Generously stuffed for your comfort and well-appointed for your convenience, this seating collection features an end reclining unit and chaise, as well as a console with cup holders and lift-up storage.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9669FCP.jpg"]},
  {id: 3690, number: "8327BE-3", name: "Deryn Collection ", description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or grey herringbone pattern to complement the teal, beige and grey seating body covers. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", category: "seating", popularity: 0, related_products: [4080, 3824, 3808, 3689, 3691, 3633, 3632, 3631, 3630], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327BE.jpg"]},
  {id: 3698, number: "19359-3", name: "Bonaventure Park Collection ", description: "With styling that exemplifies traditional design, the Bonaventure Park Collection exudes sophistication and refined elegance. Cabriole legs support the rolled arm show wood frame, while egg and dart molding, along with acanthus leaf motif lend to the base and top rail of each piece in the collection. Providing contrast to the gold-highlighted cherry finish of the frame is the brown tone chenille fabric. Complimenting contrast pillows feature three traditional patterns with each featuring accenting appropriate to their style such as faux leather piping or looped fringe. Pleated tufting is anchored by button accent providing classic prominent detail to this elegant seating collection.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/19359.jpg"]},
  {id: 3716, number: "8300-3PW", name: "Vortex Collection ", description: "Providing a bold contemporary look for the modern living space, the Vortex Collection creates the perfect platform for relaxation. With the press of a button, the end seats on the sofa, love seat, and chair recline to a prone position. The adjustable headrests provide additional comfort for the user. A low profile seating combined with light grey leather match and stainless steel feet result in the ultra-modern feel of the collection.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8300.jpg"]},
  {id: 3715, number: "8308-3PW", name: "Olympia Collection ", description: "There is no mistaking the Olympia Collection for anything but a bold study on contemporary design. Sleek lines extend with the push of a button on taking you from a seated to prone position with amazing ease, whether you are on the dual reclining sofa, dual reclining love seat, or reclining chair. The raisin tone top grain leather covers the seats, top part of the arms and front part of the backs, while leather match covers those areas beyond your initial reach. White contrast stitching further accents the design. The collection is available in several different configurations to choose from to complete your seating arrangement.", category: "seating", popularity: 0, related_products: [3680], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8308.jpg"]},
