  {id: 3886, number: "1386TPP-1", name: "Cinderella Collection ", description: "The Cinderella Collection is your little girl's dream. The Victorian styling incorporates floral motif hardware, antique ecru finish and traditional carving details that will create the feeling of a room worth of a fairy tale princess. A canopy bed completes the fantasy of this whimsical collection. Turned posts reach for the heights and are topped with carved finials. The additional trundle provides the extra sleeping space for princesses visiting from other kingdoms. Also available in dark cherry finish.", category: "youth", popularity: 0, related_products: [3884, 3887], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1386TPP-1.jpg"]},
