  {id: 4262, number: "8077-T", name: "Falls Collection ", description: "Ready-To-Assemble for your convenience, the Falls Collection offers the functional storage that you require for your recreational room. With transitional design elements, this TV stand features glass fronted media storage, slate accent, triangular door pulls and a brown cherry finish, making it the perfect choice for your home.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8077-t_2014H-16.jpg"]},
  {id: 4225, number: "4690-F2", name: "4690-F3 4690-F4 Recife Collection ", description: "From the boudoir to the parlor, the Recife Collection adds a touch of glamour anywhere it goes. This fully upholstered accent ottoman is offered in the chic hues of indigo, beige, and dark grey -\u0080\u0093 all featuring nail head accent that trims the profile of the seat base and X-leg supports.", category: "home", popularity: 0, related_products: [3967, 3706], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4690-F2 4690-F3 4690-F4.jpg"]},
  {id: 4203, number: "5415RF-15", name: "Sedley Collection ", description: "Whether your home leans to transitional or contemporary design, the Sedley Collection will be the perfect fit for your home office needs. From the distinct walnut veneer pattern to the unique framing of the desk, bookcase and file cabinet, each design component lends to placement in a variety of office settings. The dark metal horizontal hardware and metal support framing complements the finish of the group while providing distinct contrast. Convenience factors include drawer storage, reversible return desk for convenient placement within the space and open display shelves and door storage of the bookshelf.", category: "home", popularity: 0, related_products: [4073, 3592, 3457, 3289], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5415RF-15DKT 5415RF-16RDT 5415RF-17MT 5415RF-18.jpg"]},
  {id: 3528, number: "1869-1", name: "Mill Valley Collection", description: "When looking to furnish your traditional home, you choose pieces that are timeless. The classic look of the cherry finished Mont Belvieu Collection will allow you to fulfill your design desire. Pairing the panel bed of the collection with the traditional look of Louis Philippe styling, instantly creates a classic look to your bedroom. Carved finials and squared pilasters provide traditional accent to the bed as does the shell and scroll motif of the headboard and footboard that carries over to the collection's mirror.", category: "bedroom", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1869-1.jpg"]},
  {id: 3273, number: "1704-108", name: "Moorewood Park Collection ", description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that feature prominently throughout the collection. Two elegant table options allow for perfect placement within your dining room – the first, a 108-inch rectangular top leg table and the second, a round 60-inch fixed-top table. Flanking the two table options are the subtly ornate dining chairs with their prominent medallion backs and decorative neutral tone seats. The china features canted curved pilasters and legs that enhance the profile of the collection while button and bale, along with knob, hardware featured in an antiqued bronze finish lend subtle contrast. Behind glass display storage along with the doors and drawers of the supporting buffet provides ample storage space for your tabletop accessories.", category: "dining", popularity: 0, related_products: [3947, 3651, 3487, 3272], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1704-108.jpg"]},
  {id: 3604, number: "9789BRG-3LC", name: "Phelps Collection ", description: "Not every home is created the same and the unique design of the Phelps Collection allows for maximum flexibility with its reversible chaise. With two available coverings chocolate microfiber and brownish gray fabric, refined track arm, and comfortable seating, the collection's style is compatible in a number of settings. The matching ottoman provides additional comfort and function to your living area.", category: "seating", popularity: 0, related_products: [3682], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9789BRG.jpg"]},
  {id: 3396, number: "1393BK-78", name: "Ohana Collection ", description: "The design of Ohana Collection captures the essence of a casual country home. Its antique white and warm cherry, or antique black and warm cherry finishes give it a striking two-toned apprearance. The solid wood table top and unique chair back supported by turned legs complement Ohana Collection with a touch of elegance. This group is further accented by the curio which features two sliding glass doors. It’s a warm look you’ll love having in your home", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1393BK-78.jpg"]},
  {id: 3674, number: "8230BRW-3", name: "Bastrop Collection ", description: "Comfort is the name of the game in the Bastrop Collection. The collection is offered in several configurations – traditional sofa, love seat and chair, and sectional – for versatile placement in your living room maximum relaxation potential in your downtime. The two optional coverings – black or brown leather gel match – feature contrast welting for definition of profile and modern accenting. Manually engaged motion mechanisms allow for quick transition from seated to prone with the quick pull of a tab. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends, the dual glider reclining ends of the love seat flank a center mounted console with storage and cup-holders, and the chair features a glider mechanism that allows for easy back and forth motion. The sectional configuration features a left side love seat with reclining end and the right side double reclining love seat with center console unit featuring cup holders and storage.", category: "seating", popularity: 0, related_products: [3676, 3675, 3673], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8230BRW.jpg"]},
  {id: 3342, number: "2243-114", name: "Deryn Park Collection ", description: "Walking into the dining room that is occupied by the Deryn Park Collection will immediately invoke your love of the traditional aesthetic. Stately from every angle, sophisticated design elements blend to create this beautiful collection. Burl inset flanks the book-match veneered cherry-finished tabletop. With two table options – the rectangular double pedestal base, and the oval topped single pedestal – the collection allows you the flexibility to fit the scale of your dining room. Each chair features an elaborately designed back and a richly hued fabric cover. The china and coordinating server provide ample display and storage space for your tabletop accessories. The cherry finish is highlighted by gold tipping that accentuates the traditional feel of elegant Deryn Park Collection.", category: "dining", popularity: 0, related_products: [3556, 3555, 3341], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2243_114_RSX2_H_2014D-1.jpg"]},
  {id: 3743, number: "9668BLK", name: "Center Hill Collection ", description: "With plush seating that is uncommon in most traditional looks, the design of Center Hill Collection will be a welcome addition to your living room. Offered in bonded leather match, the covering comes in either dark brown or black. With traditional nailhead accent lending an elegant statement to each piece and the easy recline mechanisms adding to the comfort, the lovely Center Hill Collection will provide your friends and family a warm environment to spend their quality moment.", category: "seating", popularity: 0, related_products: [3742, 3724, 3723], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9668blk-shot1_1217C(2014)_2015S-19.jpg"]},
  {id: 3802, number: "8208-3SC", name: "Sprague Collection ", description: "With a configuration that allows for the perfect fit with your living room, the transitionally styled Sprague Collection will be a welcome addition to your home. The three seat sofa features an ottoman that is paired with the reversible chaise cushion to create a right or left configured sectional. The fossil fabric that covers is an earthy neutral tone that furthers the versatile placement within your living room.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8208-3SC.jpg"]},
