  {id: 3939, number: "5794AK-1", name: "Bart Collection ", description: "Scaled not only for ease of shipment, but size of bedroom, the Bart Collection is a clever addition to your child-\u0080\u0099s space. The bed features a welcoming design to myriad décor schemes with horizontal framing on the headboard and optional light oak or cherry finish.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5794AK.jpg"]},
  {id: 3896, number: "2147TBK", name: "Mayville Collection ", description: "Traditional in design and modest in scale, the elegant Mayville Collection takes its design inspiration from the classic Louis Philippe styling. Featuring four distinct finishes – burnished brown cherry, white, black, and the newly offered stained grey – with all of the traditional flare unique to the style – antiqued metal bale hardware and distinct framing – this collection is a perfect addition to your traditional adult or youth bedroom.", category: "youth", popularity: 0, related_products: [4154, 4153, 4152, 4135, 3893, 3901, 3897, 3550, 3523, 3549], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2147TBK.jpg"]},
  {id: 4040, number: "4727PU", name: "Synergy Collection ", description: "The need for additional storage space in your modern home will be met with the Synergy Collection. The two segments of this ottoman serve equally as storage space, yet two different functional tops define each of their roles. With the first section, an airlift mechanism lifts the seat to reveal storage below. The second section is a fully extended lift top that not only reveals storage space, but will bring the seat top towards you for those times when you need an extra table surface. This padded ottoman is covered in dark brown bi-cast vinyl with white contrast stitching.", category: "occasional", popularity: 0, related_products: [4172], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4727PU.jpg"]},
  {id: 4043, number: "2601-31", name: "Tempe Collection ", description: "With a scale appropriate for any number of cozy living rooms, the Tempe Collection will provide the look and style you want in your home. The transitional feel of the group comes from the richly hued faux marble table top and the minimalistic design of this three pack occasional group. The tables are constructed of metal with a black finish.", category: "occasional", popularity: 0, related_products: [4210, 3325], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2601-31.jpg"]},
  {id: 3297, number: "5425-36", name: "Benwick Collection ", description: "From every angle, the modern traditional design of the Benwick Collection shines through. Offered with two table options – a classic turned-leg table and a display base counter height table. Each table is flanked by elegantly designed fabric covered chairs that are supported by turned dark cherry legs. Nail head accenting furthers the chair’s modern traditional styling. The accompanying server features ample behind door storage, wine bottle rack, and brushed nickel knob hardware. Birch veneer is used throughout the collection and is enhanced by a dark cherry finish.", category: "dining", popularity: 0, related_products: [3298], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5425-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5425-36 5425-40.jpg"]},
  {id: 3311, number: "5149-36", name: "Loyalton Collection ", description: "Traditional elements of wood and metal blend to create the casual look of the Loyalton Collection. Forged of metal, the double-X patterns flow from chair back to table apron, while the traditional look of the table’s turned legs is given a modern update. Wood is utilized for the tables routed top, chair seats and chair backs. The collection is offered in two distinct styles to fit your needs – 48 inches fixed rectangular top and 40 inches square counter height top.", category: "dining", popularity: 0, related_products: [3310], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-36_topview.jpg"]},
  {id: 3313, number: "5145W-78", name: "Azalea Collection ", description: "Classic styling coupled with a sophisticated country aesthetic creates a beautiful look for your home in the Azalea Collection. The book match veneer of the table top is highlighted by utilizing a natural finish, while the antique white of the table base, chairs and server helps capture the natural contours of the wood grain. The scalloped chair rail tops the intricate pattern that is woven to create the distinct design of the chair backs, which carries over to the glass-backed door fronts of the server. The server’s door and drawer storage provide space to store table top accessories while the wine rack lends additional functionality.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5145W-78.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5145W-78 Top View.jpg"]},
  {id: 4005, number: "3299-01", name: "Vincent Collection ", description: "Glass overlays the intricate acacia wood block staggered pattern of the Vincent Collection. Each intricate pattern surrounds a center contrasting block. These unique tables feature display shelves and a modern two-toned natural acacia and espresso finish, with glass insert table tops.", category: "occasional", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3299-01.jpg"]},
  {id: 3288, number: "5431-77", name: "Compson Collection ", description: "With lines that lean to contemporary and a natural finish that can be placed in transitional settings, the unique design of the Compson Collection allows for your decorative imagination to run wild. Convenience factors of the self-storing table leaf, and the two tone finish that highlights the natural grain of the walnut veneer table top, are some of the valuable features offered in this offering. Wood framed chairs have chocolate brown fabric seats and backs that further the two-tone look of the collection. Following the curve of the table top is the optional 60-inch bench. The accompanying server features an open display shelf along with drawer and door storage for stowing your tabletop accessories.", category: "dining", popularity: 0, related_products: [3263], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431-77.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431-77 5431-14.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5431_topview.jpg"]},
  {id: 3466, number: "1958-1", name: "Bevelle Collection ", description: "Modern glamour is exemplified in the design of the Bevelle Collection. Acrylic crystals frame each piece in the collection, reflecting the light to create eye-catching drama. The silver finish serves as the perfect complement to the high-polish decorative knob hardware and medallion accents. A stylish mirrored vanity, with coordinating stool, provides additional function to the collection. Providing contrast to finish is the dark gray bi-cast vinyl, button-tufted headboard panel. A coordinating dining room is also available.", category: "bedroom", popularity: 0, related_products: [3268], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1958-1.jpg"]},
  {id: 3292, number: "5428-84", name: "Claire Collection", description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Anna Claire Collection provides an unexpectedly elegant addition to a number of dining spaces. A driftwood finish covers the wood of the two base options; a rectangular trestle table or round pedestal table with a rusticated zinc tabletop that features nail head accent banding. Three chair options are available; button tufted back, curved arm, and nail head accented. Each with a neutral toned grey fabric that compliments the look of the collection.", category: "dining", popularity: 0, related_products: [3954, 3291], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S3 5428-S1 5428-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S2.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-84 5428-S1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-40.jpg"]},
  {id: 3526, number: "2615DC-1", name: "Marston Collection ", description: "Refined elegance is exemplified in the design of the Marston Collection. Blending classic design elements to create a warm and welcoming bedroom. Each piece in the collection features turned feet and high polished oval bale pull and knob hardware. The neutral toned fabric inserts of the headboard and the padded footboard rail feature nailhead accent. Drawer storage features prominently on the footboard, offering that extra functional space that you need. The classic dark cherry finish further lends to the modern traditional look of the Marston Collection.", category: "bedroom", popularity: 0, related_products: [3975, 3974, 3300, 3299, 3338], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2615DC.jpg"]},
  {id: 3391, number: "3270-60", name: "Archstone Collection", description: "Contemporary design, sleek seating and the combination of black finish with white accents are all the ingredients you need to create a stylish setting for exceptional dining. The white faux marble top pairs perfectly with a cut out center chair back, the color contrast and stylish design create a rich visual enhancement. Chairs are available in white bi-cast vinyl and black bi-cast vinyl.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/3270-60 _BK.jpg"]},
  {id: 3323, number: "710-72TR", name: "Daisy Collection", description: "Daisy Collection combines superb visual appearance and fine quality that you need in your dining area. Three distinct elegant flared tulip bases support beveled glass tabletops on the rectangular and round traditional dining height tables and a round gathering height table. Additional offering is the trestle table with black glass insert. Counter and dining height chairs feature clean lines and sleek curves; available in both white and bi-cast vinyl and dark brown bi-cast vinyl. The set is constructed of hardwood solids and veneers in a refreshing espresso finish.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/710-72.jpg"]},
  {id: 3759, number: "9723", name: "Geoffrey Collection", description: "Sure to please the gadget lover in any household is the Geoffrey Collection. With the touch of a button you automatically recline in this comfortable seating offering. Further enhancing this electronic wonder is the textured chocolate plush microfiber cover. Also available in traditional manual pull reclining mechanism.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/9723++SHOT1++0104++++final_2014S-34.jpg"]},
  {id: 3891, number: "1936T-1", name: "Vestavia Collection ", description: "The contemporary styling of the Vestavia Collection provides a unique platform from which to redecorate your bedroom. Faux wood printed veneer provides subtle texture and a grey finish as perfect contrast to the dark brown finish of the base rails of the case pieces and back panels of the headboard and footboard. Clean lines lend to the angular modern look and are enhanced by the horizontal brushed nickel hardware. Offered in both adult and youth beds, this collection provides great flexibility to your rooms at home.", category: "youth", popularity: 0, related_products: [3499], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1936T-1.jpg"]},
  {id: 3253, number: "5494-106", name: "Savion Collection ", description: "Sophisticated soft contemporary design is achieved in your dining room with the addition of the Savion Collection. Two table types are offered as versatile options to fit in your space – a rectangular double pedestal table and an oval single pedestal table. Both featuring a distinct birdcage style base. An espresso finish highlights the unique veneer pattern. Dramatic flair is lent to the design by the accompanying chairs. Neutral tone fabric covers the substantially sized roll back arm and side chairs. Reeded fronts on the server along with the serpentine profile further the elegance of this distinctly sophisticated collection.", category: "dining", popularity: 0, related_products: [3252], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5494-106.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5494-106_topview.jpg"]},
  {id: 3314, number: "5123-96", name: "Hollyhock Collection ", description: "Rusticated country styling blends effortlessly into your home with the Hollyhock Collection. The distressed white finish not only serves as a bold color for your dining room, it also elegantly highlights the natural wood finish of the table top. The combination of white wood and dark metal forming the knob hardware of the china, presents a focal contrast to this functional piece. Drawer and door storage provide ample storage and display space for your table top accessories. The traditional look of the chairs – slat backs and finial topped – further lends to the country styling of this classic dining collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5123-96.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5123-50.jpg"]},
  {id: 3277, number: "5429-36", name: "Angstrom Collection", description: "Following the trend of modern industrial inspired design is the Angstrom Collection. Metal framing provides support to the two distinctly shaped burnished wood table tops – one a rectangular table with built-in wine rack, the other an adjustable round counter-to-pub height table – as well as the accompanying stools. Turning the seats allows for quick adjustment to counter or pub height, while the option for a traditional back stool or a no-back stool allows for your personal preference to reign in designing your space.", category: "dining", popularity: 0, related_products: [3278], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36 5429-24ST.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5429-36 5429-24.jpg"]},
  {id: 3291, number: "5428-45RD", name: "Claire Collection", description: "Creating a unique style that blends femininity with gracefully weathered industrial accenting, the Anna Claire Collection provides an unexpectedly elegant addition to a number of dining spaces. A driftwood finish covers the wood of the two base options; a rectangular trestle table or round pedestal table with a rusticated zinc tabletop that features nail head accent banding. Three chair options are available; button tufted back, curved arm, and nail head accented. Each with a neutral toned grey fabric that compliments the look of the collection.", category: "dining", popularity: 0, related_products: [3954, 3292], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S2 5428-40.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-45RD 5428-S3.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5428-40.jpg"]},
  {id: 3303, number: "5251-108", name: "Delavan Collection", description: "Subtle influence for the design of the Delavan Collection is drawn from the classic look of Art Deco styling. The flared pedestal table base ascends to support the book-matched veneer tabletop. Oval wood-backed chairs feature a complementary radiant veneer pattern and neutral toned padded seats and backs. The rich brown cherry finish serves to highlight the exquisite look of the collection’s wood veneer. The collection is shown with the china and server of Keegan Collection. The china cabinet, which stands at attention, not only functioning as a storage facility for all of your tabletop’s finest, but also as the grand centerpiece of this stylish dining offering. For additional storage, or for smaller spaces, the server features wine storage and unique mirror accent that adds a small height to the standard server. Storage features prominently on both pieces.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5251-108.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5251 2546-40 2546-40M.jpg"]},
  {id: 3359, number: "1157", name: "Ride Collection ", description: "A fun and unique way to add a little color to your casual recreation or dining room is the Ride Collection. Offered in a variety of contemporary colors, shapes and sizes, each bar stool features a gas lift mechanism that allows for the stool to rise and descend with the simple touch of a lever. Sold in 2-piece per carton.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1157 Low.jpg"]},
  {id: 4200, number: "458B-PU", name: "Vega Collection ", description: "The cocktail ottoman with storage trunk of the Vega Collection offers an inventive way to store your assorted odds and ends out of the way but still within reach. The fully upholstered ottomans feature removable tops that open up to a finished interior perfect for storage while the removable top also functions as a tray. Base finish is espresso, available in either light brown mottled microfiber or dark brown bi-cast vinyl.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/458B-PU.jpg"]},
  {id: 3319, number: "1867-102", name: "Florentina Collection ", description: "The elaborate designs of Old World Europe are treated with a distinct modern touch in the Florentina Collection. The elegant pedestal base table serves as the focal point of this stunning dining offering. With details such as shell and acanthus leaf scrolling which grace the table’s apron to the eye-catching jewel tufting of the accompanying chairs, which reflect with a brilliance intended to accentuate the dusky taupe coloring of the faux silk and the rich silver – with gold undertone – finish of the wood veneer. The acanthus motif is carried over to the display china, that along with carved cabriole feet, delicately designed knob hardware, glass shelving, and drawer storage, complete the traditional look of the collection.", category: "dining", popularity: 0, related_products: [3536], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1867-102.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1867-40.jpg"]},
  {id: 3462, number: "1977-1", name: "Aviana Collection ", description: "Created for the traditional bedroom, the Aviana Collection is a study in classic styling and modern presentation. An antiqued gray finish provides an open canvas for your personal decorative touch. Carved feet support classically styled case goods – each featuring teardrop hardware with an antiqued pewter finish. Raised panels further the traditional look of the case piece drawer fronts. The collection is offered in twin, full, queen, eastern king and california king for perfect placement in your home.", category: "bedroom", popularity: 0, related_products: [3879], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1977.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1977-7_hp.jpg"]},
  {id: 3368, number: "5447-36XL", name: "Bayshore Collection ", description: "Transitional aesthetic meets modern lines in the casually elegant Bayshore Collection. Offering flexibility in the collection are the options of two dining tables. The 47.5-inch fixed oak veneer square table top. And the rectangular oak veneer tabletop with leaf. Both tables feature quartered book-match walnut inlay veneers with a heavily burnished finish. Supporting the uniquely veneered table top is a storage table base with a display shelf. Both tables are complimented by dark brown bi-cast vinyl chairs that feature wood cap and legs. Coordinating server is also available.", category: "dining", popularity: 0, related_products: [3442, 3434, 3423, 3422], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36XL.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36XL 5447-24FAS.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5447-36 Top.jpg"]},
  {id: 3340, number: "5052-118", name: "Thurmont Collection ", description: "Stately in design and presence, the Thurmont Collection provides a timeless statement to your formal dining room. Acanthus leaf carvings provide a continuous theme throughout the collection -featured on the china, table and chairs. Cherry book-match veneer provides a classic look to the table top as do the elegantly curved legs. Routing is featured prominently on the accenting chairs, flowing with each curve. The chair backs have an overlay wood design that highlights the richly toned hues of the chair's fabric. Serving as a grand focal point, the china's arched top and decorative beveled glass serve to display your tabletop accessories. Finally, a rich cherry finish adds to the overall design of the Thurmont Collection.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5052-118-shot1_mixing color 2014D-3.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5052-118-shot3_2014D-3.jpg"]},
  {id: 3350, number: "2546-96", name: "Keegan Collection ", description: "Exuding the sophisticated elegance that your formal dining room calls for, the Keegan Collection will wow your dinner guests. The china cabinet stands at attention, not only functioning as a storage facility for all of your tabletop’s finest, but also as the grand centerpiece of this stylish dining offering. For additional storage, or for smaller spaces, the server features wine storage and unique mirror accent that adds a small height to the standard server. Storage features prominently on both pieces. Each of the dining tables in the collection – 108 inch tabletop with double pedestal base and 96 inch tabletop with leg supports – feature a lovely veneer pattern that is highlighted by the rich brown cherry finish. Accenting hardware is featured in satin nickel. The complimenting chair features a neutral tone fabric seat and elegantly overlapping chair back design.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2546-96_50_2014D-18.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2546-96_40_mixing color 2014D-18.jpg"]},
  {id: 3388, number: "5448-78", name: "Avery Collection ", description: "Dine in style and comfort with the Avery Collection. The table features ash veneers in a rich espresso finish and a flared open base which adds a soft contemporary touch. The table extends from 60-inche to 78-inche by using the extension leaf conveniently under the table top when not in use. The contemporized parson’s chair completes the look by adding a touch of luxurious comfort. The chair is upholstered in a linen-like fabric that adds a sophisticated contrast to the dark finish of the table and chair legs. The Avery Collection will add comfort and style to your home dining experience.", category: "dining", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5448-78 NEW.jpg"]},
  {id: 3665, number: "8206NF-3", name: "Aram Collection ", description: "With amply appointed offerings that create not only a comfortable seating experience but a functional one as well, the Aram Collection will be a welcome addition to your home. The seating group is offered in a brown fabric or dark brown AireHyde for comfort and style that will blend effortlessly with your transitional decorative preference. Manual motion mechanisms operate with the pull of a side-mounted tab, that once engaged, take you from seated to reclined in an easy motion. Each piece in the collection has an individual function allowing for convenience and comfort. The sofa features dual reclining ends and a drop down center seat back with cup-holders, electric receptacles, USB port and tabletop space, the dual glider reclining ends of the love seat flank a center mounted console with storage, electric receptacles and cup-holders, and the reclining chair features a glider mechanism that allows for easy back and forth motion.", category: "seating", popularity: 0, related_products: [3666], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8206NF.jpg"]},
  {id: 3641, number: "8245BR-3", name: "Kenner Collection ", description: "A classic and functional option for your living room is the Kenner Collection. Unfettered design allows for your individual decorative aspirations to soar. The sofa is available in both a pull out sleeper or traditional setup. The sofa and love seat are paired with contrast pillows. Two fabric options are available – Gray or Brown fabric – for versatile placement in a number of environments.", category: "seating", popularity: 0, related_products: [3642], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8245BR.jpg"]},
  {id: 3651, number: "17049-3", name: "Moorewood Park Collection ", description: "Classic elements combine to create the refined styling of the Moorewood Park Collection. The casual pecan finish over pecan veneers of the show wood frame belies the expected vision of stuffy traditional design with the light finish creating a unique statement to the medallion and gracefully scrolled motifs that lend accent to the profile of the collection. The natural tone fabric body of the seating collection is accented beautifully with contrast toss pillows highlighted with subtle shades of cream and teal. The collection also features reversible seat cushions. Button tufting and gracefully scrolled arms lend to the elegant traditional styling.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/17049.jpg"]},
  {id: 3689, number: "8327TL-3", name: "Deryn Collection ", description: "Mid-Century modern design is the inspiration for the Deryn Collection. Wide, dramatically curved arms rise to the straight back that is synonymous with this classic style. Contrast toss pillows and an additional chair option are featured in a modern teal or grey herringbone pattern to complement the teal, beige and grey seating body covers. Natural tone finished legs support the frame while tailored stitch tufting lends further accent to this thoroughly modern collection.", category: "seating", popularity: 0, related_products: [4080, 3824, 3808, 3691, 3690, 3633, 3632, 3631, 3630], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8327TL.jpg"]},
  {id: 3701, number: "8414DBR-3", name: "Wasola Collection ", description: "Designed for the ultimate relaxation, the Wasola Collection provides plush seating and unique features to satisfy your comfort needs. The center seat of the sofa reclines along with the two end seats, a function that equalizes the race for a relaxed position. Dual reclining seats of the love seat flank the functional center console-\u0080\u0099s lift top storage and cup holders. A glider reclining chair completes the seating offering. The Wasola Collection is offered in brown 100% polyester fabric or dark brown leather gel match.", category: "seating", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8414DBR.jpg"]},
  {id: 3678, number: "8480GRY-2LCN", name: "Pecos Collection ", description: "The Pecos Collection blends style and function to create a platform for relaxation. Modernizing the look of the ample seating is an inset contrast welt. Chair, love seat and sofa are available in both manual and power version while the sectional is available in manual version only. With a pull of the handle, the user is changed from a seated position to a reclined position smoothly. The leather gel match covered collection is offered in three stylish colors – gray, red and dark brown.", category: "seating", popularity: 0, related_products: [3709, 3708, 3707, 3677, 3679], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8480GRY_2LCN%2BCR%2BAR%2B2R 3292.jpg"]},
  {id: 3746, number: "8524BK", name: "Talbot Collection ", description: "Designed with your bold design choices in mind, the contemporary Talbot Collection will provide your family and friends with a comfortable place to spend their quality time. Offered in red or black bonded leather match, the race car inspired bucket seat is fine tuned by contrast double stitching. Features include: adjustable headrests, reclining ends sofa, glider reclining love seat with console and glider mechanism equipped coordinating chair.", category: "seating", popularity: 0, related_products: [3745], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8524bk_mix photo.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8524BK_home.jpg"]},
  {id: 3868, number: "B2013SBDC-1", name: "Rowe Collection ", description: "Maximizing sleep space is achieved with the stylish Rowe Collection. This transitional bedroom group is featured in a dark cherry finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2013SBDC-1 -R.jpg"]},
  {id: 3841, number: "1191F6S", name: "Orson Collection ", description: "The padded upper back of the Orson Collection is supported by wooden slats that give way to the substantially sized seat of this whimsical accent chair. The collection has six available fabric options -\u0080\u0093 Blue tonal stripe, Black & White swirl, Multi-color poppies, Purple Medallion, Voyage and Grey Medallion.", category: "seating", popularity: 0, related_products: [4179, 4178, 4177, 4176, 4175, 4174, 3846, 3845, 3844, 3843, 3842], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1191f6s_2014H-79.jpg"]},
