  {id: 3894, number: "B1799-1F", name: "Clementine Collection", description: "With a design as sweet as the name implies, the Clementine Collection will be a bright and classic addition for your children’s sanctuary. Scaled for your child’s bedroom, the traditional bed and bunk bed offer a customizable sleep spaces to suit your individual needs. Wooden knob hardware stands boldly against the double bow-fronted case goods while the additional decorative accents of framed bead-board paneling and scalloped base carry over to the design of the turned post headboard and footboard – further enhancing the classic look of this lovely bedroom. The bunk bed features an optional full-size extension kit for the lower bunk. Also offered for each bed in the collection is a functional trundle allowing for the option of either storage or twin bed.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B1799-1.jpg"]},
  {id: 3895, number: "B1799T-1", name: "Clementine Collection ", description: "With a design as sweet as the name implies, the Clementine Collection will be a bright and classic addition for your children’s sanctuary. Scaled for your child’s bedroom, the traditional bed and bunk bed offer a customizable sleep spaces to suit your individual needs. Wooden knob hardware stands boldly against the double bow-fronted case goods while the additional decorative accents of framed bead-board paneling and scalloped base carry over to the design of the turned post headboard and footboard – further enhancing the classic look of this lovely bedroom. The bunk bed features an optional full-size extension kit for the lower bunk. Also offered for each bed in the collection is a functional trundle allowing for the option of either storage or twin bed.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B1799T-1.jpg"]},
  {id: 3902, number: "815TPU-1", name: "Copley Collection ", description: "The Copley Collection features clean contemporary design that will complement any home d cor. With economical and environmental concerns in mind, the night stand, dresser and mirror are conveniently packed in one carton. Chest and additional night stands are also available. The Copley Collection showcases a wide beveled wood frame with satin nickel hardware accented in espresso finish on select hardwoods and veneers. To offer more flexibility, it offers three headboard options: wood sleigh headboard, panel headboard with white bi-case vinyl inserts, and fully upholstered dark brown bi-cast vinyl headboard.", category: "youth", popularity: 0, related_products: [3579, 3578, 3552, 3557], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/815TPU-1.jpg"]},
  {id: 4120, number: "H11302", name: "Kiran Collection", description: "The floating orbital orbs accent lighting table lamp gravity defying design features three aluminum wraped sparkling orbs suspended mid-air, arranged in orbital order on an elegant curved stand, illuminating warm white light rays. The piece is beautifully crafted using high quality satin nickel finish metal. Remarkable addition piece on your night stand, end table, or sofa table. Great accent lighting that can enhance the surrounding ambiance, perfect for a night light, or a mood light to brighten up any room.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H11302_c_light on.jpg"]},
  {id: 4076, number: "1192GY", name: "Lucille Collection ", description: "Retro lines need not stay in the past with the mid-century inspired lines of the Lucille Collection. With fabric offerings that range from neutral to bold such as beige, gray, blue, and orange further complemented with button-tufted accenting and stylishly appointed legs, this classic accent chair will provide a look that shows your personal style.", category: "home", popularity: 0, related_products: [4075, 4078, 4077, 3781, 3780, 3779, 3778], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1192GY.jpg"]},
  {id: 4110, number: "471PPE", name: "Clair Collection ", description: "As in many homes, the need for functional storage is great. The Clair Collection offers not only the function of storage, but seating as well. The unit is covered in a rich chocolate corduroy, leopard print, or purple medallion fabric and is also available in dark brown, red, taupe or purple bi-cast vinyl that features baseball stitching.", category: "home", popularity: 0, related_products: [4169, 4168, 4111, 4109], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/471PPE.jpg"]},
  {id: 4147, number: "1249F1S", name: "Alta Collection ", description: "Blending the comfort of a lounge chair with the functionality of the internal lift mechanism, the Alta Collection will be a welcome addition to your home. With an electric mechanism that, with a push of a button, takes you from fully reclined to standing, this chair aids in your mobility. The lift chair is offered in dark brown bi-cast vinyl, with contrast stitching, for versatile placement in your transitional to contemporary home.", category: "home", popularity: 0, related_products: [3830], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1255F1S 1249F1S.jpg"]},
  {id: 4142, number: "6472", name: "Amara Collection ", description: "Fun, funky and functional, the Amara Collection will provide your home with interesting conversation pieces and a look that is as unique as you are. With the turn of a crank, the adjustable table (6414) can be raised or lowered to suit your individual needs. Black iron is complimented by the bold red and white hued design of the -\u0080\u009CAtellier Loft-\u0080\u009D print that appears on the dining tabletop and carries its theme to the caster supported cocktail table (6409) -\u0080\u0093 paired with our tractor seat adjustable iron barstool (6412), you will have created the creative focal point for your dining space.", category: "home", popularity: 0, related_products: [4028], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/6472.jpg"]},
  {id: 4123, number: "H13441", name: "Etsu Collection", description: "This accent lighting can change the ambiance of any room. Its ultra modern design showcases sparkling decorative mood light, with tiny rippling water-droplets to simulate the soothing dancing water motion. Beautifully crafted stand features high quality satin nickel finish metal and glass, and an elegant circular lamp shade. Great addition piece on your night stand, end table, or sofa table. It offers flexible lighting solution: a table lamp with a main light that is suitable for reading, perfect for a night light, and to create the mood in any room.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/H13441_e.jpg"]},
