  {id: 4091, number: "1260F1S", name: "Essex Collection ", description: "With a classic profile that is covered in a dark grey or blue fabric, the Essex Collection utilizes high polish nail head accenting to provide a modern twist to the design of this elegant accent chair. Rolled tufting furthers the traditional look as do the cherry finished support legs.", category: "home", popularity: 0, related_products: [4090, 3819, 3818], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/1260F1S.jpg"]},
