  {id: 4257, number: "35800-T", name: "Fairhope Collection ", description: "Metal scroll-work lends a feminine touch to the side supports and framing of the beautiful Fairhope Collection. The three display shelves of this entertainment unit feature faux marble tops creating a timeless look and elegant functionality.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/35800-T.jpg"]},
  {id: 4258, number: "35810-T60", name: "Chehalis Collection ", description: "With a design that is inspired by the traditional look of Craftsman furniture, the Chehalis Collection features slate inlay on the console front, and a brown cherry finish that enhances the oak veneers of this well-appointed entertainment offering. At sixty inches wide, the unit provides a significant platform for your television. Door storage features prominently as does the open media storage.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/35810-T60.jpg"]},
  {id: 3878, number: "2046T-1", name: "Garcia Collection ", description: "Transitionally styled for your bedroom is the Garcia Collection. Created for versatile placement within a number of environments the louvered panel accents, distinct framing along with a cool gray finish over birch veneer combine to provide a clean palate for your personal decorative style. Nickel knob hardware provides subtle, yet distinct, contrast to the fronts of each case piece. The available desk is a functional addition to the collection with keyboard tray and drawer storage. The collection is offered in twin, full, queen, eastern king and california king for the perfect fit within your bedroom.", category: "youth", popularity: 0, related_products: [3460], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2046-1.jpg"]},
  {id: 3863, number: "B2043FF-1", name: "Bartly Collection ", description: "With options that allow for the perfect placement within your bedroom is the Bartly Collection. This transitional bedroom group is featured in a natural pine finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin, full over full configurations -\u0080\u0093 along the newly available captains bed, with trundle that features two drawers, and twin/twin bunk with storage stair steps - the design allows you to choose the size that is right for your family. Two under bed options are available for the bunk beds -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2043FF-1.jpg"]},
  {id: 3935, number: "4829DB", name: "Caffery Collection ", description: "In creating the perfect recreational room, you need functional pieces that provide comfort to your friends and family. The Caffery Collection, with a quick adjustment to the click mechanism, turns from a casual sofa into a flat platform perfect for sleeping or just hanging out. Offered in a dark brown bi-cast vinyl with white contrast stitching or dark grey fabric, the collection also features cup holders at arms for added convenience.", category: "youth", popularity: 0, related_products: [3839, 3933], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4829DB-1.jpg"]},
  {id: 3903, number: "B2013FFDC-1", name: "Rowe Collection ", description: "Maximizing sleep space is achieved with the stylish Rowe Collection. This transitional bunk bed is featured in a dark cherry finish making it an appropriate choice for a number of youth bedroom settings. With twin over full, twin over twin and the newly added full over full configurations, the design allows you to choose the size that is right for your family. Two under bed options are available -\u0080\u0093 toy boxes that provide additional storage space or twin trundle that offers additional sleep space.", category: "youth", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/B2013FFDC-1.jpg"]},
  {id: 4233, number: "8018C", name: "Culbert Collection ", description: "With your living room serving as the center for your family-\u0080\u0099s relaxation and social time, the Culbert Collection provides the platform for storage, display, and use of your home entertainment system. Featuring side shelving units along with bridge display storage, your television will be surrounded by books, DVD-\u0080\u0099s, and objects that bring you enjoyment. The lower supporting cabinet features glass fronted door storage that allows for easy use of remote controlled devices. This transitional unit is finished in a warm cherry and has round knob hardware that compliments.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8018C-P.T_2014H-2.jpg"]},
  {id: 3960, number: "5466-30", name: "Festus Collection ", description: "Offered for your living room is the Festus Collection. Extending to support and frame the corners of the light toned genuine marble tabletop are dark cherry finished legs. At home in contemporary to transitional settings, the Festus Collection will be a stylish addition to your home.", category: "occasional", popularity: 0, related_products: [3285], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5466-30.jpg"]},
  {id: 4060, number: "4521", name: "Cabernet Collection ", description: "Created in the profile of a wine barrel the Chardonnay wine refrigerator will be the talk of your next gathering. The door of the unit opens to reveal row upon row of wine storage racks ready for you to load your favorite bottles. The lift top conveniently provides storage and the controls that keep your favorite wine at the optimal temperature. The dark cherry finish complements the rustic look of this unique unit.", category: "home", popularity: 0, related_products: [4235], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/4521.jpg"]},
  {id: 4228, number: "8014", name: "Lenore Collection ", description: "Designed to serve as the focal point of your entertainment room, the Lenore Collection will provide a functional and stylish platform to display your TV, decorative accents and media consoles. Transitional accents such as bun feet, metal knob hardware and a rich cherry finish lend to the classic look. A lighted bridge highlights the display shelf, each providing support to join the two side unit bookcases. Glass and solid door storage, along with the shelving of the bookcases, provides ample storage for your display accents.", category: "home", popularity: 0, related_products: [], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/8014.jpg"]}
